INSERT INTO `blog_posts` VALUES
(24, '2016-12-09 08:16:02', '2017-04-24 16:00:14', 1, 'Heavy Metals, Toxic Air', 1, 'Portland, Oregon a TOXIC AIR MESS', '<h2><a href=\"http://koin.com/2016/02/24/heavy-metals-in-your-body-theres-a-test-for-that/\">Click This Link To See Video Clip</a></h2>\r\n\r\n<h2>It&rsquo;s their dirty little secret!</h2>\r\n\r\n<p>Portland is ranked as one of the top most toxic and polluted cities in America, yet also &nbsp;ranked as the top eco friendly city in America. We can&rsquo;t seem to wrap our fingers around that one. Seems so oxymoronic wouldn&rsquo;t you say? Don&rsquo;t let the pretty green trees and over 92,000 acres of green space for hiking, the overly abundant bicycle riders in every direction, and endless city transit fool you. Portland is also ranked to be one of the most toxic and polluted cities in America with over 2,300 permits filed by industrial facilities such as huge mills and major manufacturing to release heavy metal toxicity into the air for people to breath, and it&rsquo;s all LEGAL. We&rsquo;re talking about hundreds of tons of toxic compounds into the air. Did I mention, Oregon&rsquo;s water ways are also one of the worst in the nation too. This is due to 645 tons of toxic chemicals dumped into waterways each year. To put this into perspective that amount of waste is equivalent to 430 Toyota Prius, please excuse the humor Portland.</p>\r\n\r\n<p>In our air we breathe these toxins which contain Arsenic, Cadmium, Cobalt, and Nickel, among other toxic heavy metals, and there&rsquo;s a lot. The toxic air is of course entered in our lungs and into our blood stream slowly destroying our DNA and future off springs DNA as well. This toxic air is significantly linked to major neurological disorders and cancers, yet the law allows it. &nbsp;And it just so happens to be that the nation&rsquo;s top industrial air polluters are right here in the Portland Metro area, hmm&hellip; go figure. If you&rsquo;re from the Portland metro area, you&rsquo;ve probably heard of Portland&rsquo;s&nbsp;<strong>Precision Cast Parts</strong>, makers of aircraft and engine parts, and&nbsp;<strong>Bulls Eye Glass&nbsp;</strong>manufactures located in SE Portland, to name a few, releasing Cadmium, Arsenic, Cobalt, and roughly 30 other toxic substances but has recently added some better filters according to the Oregonian, yet New Century Labs is still getting back very high levels of Arsenic test results from individuals purchasing our&nbsp; comprehensive&nbsp; heavy metals tests on our website, by collecting random urine tests. This has us very concerned.</p>\r\n\r\n<p>Pointing the finger at just one or two companies &nbsp;is a great start to take action and to start demanding cleaner air for Portland and surrounding areas. Although the media has the SE glass company on its Bulls Eye (No Pun) &nbsp;the exposure to people&nbsp;living around OTHER manufacturing companies, factories, and mills, are just as exposed to the same toxicities &nbsp;for those who live around them, and the Portland Metro area has a lot of industrial &nbsp;manufacturing.</p>\r\n\r\n<p>Testing positive for heavy metals is a major issue, but the question is where should one go who&rsquo;s tested positive for heavy metal exposure, and where do you go for treatment? How about what is the treatment?</p>\r\n\r\n<p>We asked our customers who ordered these tests, who then took their results back to their Medical Doctors, some of which showed their doctors in Kaiser hospital, they said they didn&rsquo;t know exactly what the protocol was for treatment, &nbsp;how to interpret the tests, &nbsp;and said they may want to go see a Naturopathic doctor. We spoke to several Naturopathic doctors and they had loads of information on what to do when there&rsquo;s positive exposure to heavy metals. Apparently heavy metals is a core subject taught in the school of Naturopathic medicine, most MD&rsquo;s who are involved in heavy metal treatment are specialists.</p>\r\n\r\n<p>How about the individual who hasn&rsquo;t tested for heavy metals who should they talk to and where do they go? Although &nbsp;NCL will never&nbsp;&nbsp;give medical advice you should always discuss healthcare issues &nbsp;with your doctor first. &nbsp;However access to lab tests at&nbsp;New Century Labs and getting heavy metal testing has been made easy to access, online, on demand, on your terms.</p>\r\n\r\n<p>We decided to do some digging and &nbsp;called the Oregon Health Authority at 1-800-273-0557 they told us to call the EPA. The EPA, what&hellip; why?? We asked them specific questions about how one can get a test and what the cost would be, even asked who the diagnostic companies were offering testing. Of course they had no answer, and no protocol in place, yet they get several calls per day regarding this question.</p>\r\n\r\n<p>Although I was disappointed with their answers we found more resources&ndash;I&rsquo;m on to something! Multnomah County Health Department, they should know! We asked them the same questions were asked, although we got better answers, access to obtaining Heavy metal tests sounded daunting, yet they also didn&rsquo;t know who the diagnostic testing providers were, and couldn&rsquo;t answer how much it would cost, the tests weren&rsquo;t free even if you worked in Bulls Eye Glass and were exposed every day!</p>\r\n\r\n<p>Its seems that the main focus with city, county, and government officials has not &nbsp;been so focused on&nbsp;&nbsp;peoples questions and concerns about getting tests, especially people who cannot afford them, and what to do when you test positive for heavy metals.&nbsp;When we called the Oregon Health Authority we were put on hold for 30 min, and 20 minutes with the county health clinic, and that&rsquo;s just on the phone. Now you have to drive there, sit in the waiting room, pay your co-pay and then see the doctor for 5 min who may or may not give you a lab order for a metals test.</p>\r\n\r\n<p>As much as government officials have tried to provide resources, we believe the resources are simply not enough and very frustrating for many.</p>\r\n\r\n<p>New Century Labs is a private company located in the heart of Lake Oswego, our business is digital, automated, and extremely efficient. Folks concerned about heavy metal tests can order labs from our website, or by simply calling us at 1-800-519-2997 to place an order. If you cannot afford a test we will work with you to make sure you get your tests done ASAP.</p>\r\n\r\n<p>NCL is far more efficient, we can create a lab order and email it to you fast, sometimes within minutes, and you can visit one of our affiliated patient service centers to get your labs done without making an appointment. Your results are emailed back to you in 5 business days or less. You can then take your lab test results and start having a meaningful conversation with your doctor.</p>\r\n\r\n<p>Our goal at NCL is to break apart from the traditional system of obtaining lab tests. This means giving people access to labs on demand when they want it, lowering the price up to 90% off and showing transparency with no surprise bill, all while performing these tests at the highest diagnostics quality, we choose to work with Quest Diagnostics. You have resources now, we&rsquo;re looking forward to serving you at NCL as your preferred source&nbsp;for lab testing.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 6, '8431481271392.jpg', 'Portland is ranked as one of the top most toxic and polluted cities in America, yet also  ranked as the top eco friendly city in America. ', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'portland-oregon-a-toxic-air-mess'),
(25, '2016-12-09 09:34:10', '2017-04-24 15:59:18', 1, 'Arsenic, cadmium, Heavy Metals', 1, 'Heavy Metals Making Air Toxic to Health in Portland, Oregon', '<p>When the state of Oregon advises residents not to eat the food from their backyard gardens, people tend to take notice. And for good reason. Results of tests for Arsenic, Cadmium and Nickel in the air near glass manufacturing plants in Southeast Portland were so high that the businesses voluntarily stopped using some of the chemicals to make glass that are toxic, and have pledged to continue to work with the Oregon Department of Environmental Equality. Arsenic levels in the air were at 159 times the state&rsquo;s air safety benchmark. The city has hosted several community meetings for the public, but at the end of the day residents are left to wonder, &ldquo;Has my family been exposed?&rdquo;&nbsp;Not to mention &ldquo;where do I go to get tested?&rdquo;</p>\r\n\r\n<p>Human exposure to arsenic by inhalation has been shown to be strongly associated with lung cancer. Chronic exposure even at small amounts has been attributed to Diabetes. And no wonder the state is telling us not to eat the vegetables from our gardens because of possible soil toxicity: ingestion of inorganic Arsenic by humans has been linked to a form a skin cancer and also to bladder, liver and lung cancer. The EPA has classified inorganic arsenic as a human carcinogen. Nickel is also toxic, resulting in slight skin irritations to more serious issues such as gastrointestinal distress as well as neurological effects.&nbsp; Chronic exposure to nickel can cause issues such as respiratory failure, heart disorders, asthma and chronic bronchitis, plus an increased risk of cancer of the lung, larynx, nose and prostate.</p>\r\n\r\n<p>Exposure to heavy metals can have very serious consequences, especially when children are exposed. For example, young children are more susceptible to the effects of lead exposure because they absorb several times the percent ingested compared with adults and because their brains are more plastic and even brief exposures may influence developmental processes. You and your children could be exposed without even knowing it. The only way to detect this is through a urine test, called a Comprehensive Heavy Metals Panel, which shows past exposure over the course of a day or two. Although more expensive, a hair strand test will show exposure over 6 to 12 months. Oregon health officials, in a show of how serious this is, have offered to pay for testing residents&rsquo; urine for heavy metals if they cannot afford it themselves. Through a doctor&rsquo;s office, insurance will sometimes pay for testing. However, if there are no symptoms, they may deny the claim and pay nothing. Thankfully there is another, less expensive option, through New Century Labs.</p>\r\n\r\n<p>Our Comprehensive&nbsp;<a href=\"https://newcenturylabs.com/product/heavy-metals-comprehensive-panel-u\">Heavy Metals Panel&nbsp;</a>covers 7 metals, including&nbsp;<strong>Cadmium, Arsenic, Lead, Mercury, Thallium, Creatinine, and Cobalt</strong>&nbsp;among others listed individually, for just $299 with an additional discount for the month of March by entering coupon code TOX2016. Find out if you or your loved ones have been exposed and check out our full line of<a href=\"https://newcenturylabs.com/shop?sa_product_cat=128\">&nbsp;heavy metal tests.</a></p>\r\n\r\n<p>The moral of our store is what you can&rsquo;t see CAN hurt you!</p>\r\n', 6, '4011481291989.jpg', 'When the state of Oregon advises residents not to eat the food from their backyard gardens, people tend to take notice.', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'heavy-metals-making-air-toxic-to-health-in-portland-Oregon'),
(26, '2016-12-09 10:41:37', '2017-04-24 16:02:58', 1, 'Hormone Balance', 1, 'The key to health is hormone balance', '<p>Did you know your personality, your mood, your outlook in life, what we aspire to be, everything that sets that spark to motivation, our ability to combat unwanted diseases all&nbsp;stem from&nbsp;hormones&ndash; hormones,&nbsp;ideally, regulate who we can optimally be.&nbsp; If your hormones are off balance it can dramatically have an effect on your work performance, relationship, mental health and it can set the stage for&nbsp;disease.</p>\r\n\r\n<p>The commonly known glands that regulate our hormone system are the thyroid glands, the ovaries in women, the testicles in men, the adrenal glands in the belly, in addition to the pituitary in the head. Hormones act as messengers that move through the blood into tissues, where they act to regulate every process in the body, including emotions. Put simply, they regulate your general health and overall well-being.</p>\r\n\r\n<p>Hormones have individual effects on the body. They also interact with each other to produce dramatic effects in the body. Due to these interactions, they can trigger drastic reactions in multiple body systems.</p>\r\n\r\n<p>Hormones should work in harmony with each other as they affect every day health and well-being. Body systems are stable when hormone balance exists. When balance is lost, hormone deficiencies and excesses cause serious disorders and increased risk of diseases.</p>\r\n\r\n<p><strong>Female Hormones</strong></p>\r\n\r\n<p>Besides their role in reproduction,&nbsp;<strong><a href=\"https://newcenturylabs.com/product/estrogen-total-serum/\">estrogens&nbsp;</a></strong>are important in maintaining healthy reproductive tissues, breasts, skin, and the brain. Progesterone is often described as &ldquo;the hormone balancer&rdquo;, particularly of the estrogens in your body. Progesterone enhances the known benefits of estrogen, while preventing problems related to having too much estrogen.</p>\r\n\r\n<p><strong>Male Hormones</strong></p>\r\n\r\n<p>Testosterone is the major male hormone produced in the testicles. Excess production of estrones (an estrogen) relative to testosterone is known to contribute to the development of prostate problems. Most scientists now agree that estrogen dominance is the cause of both prostate and breast cancers.</p>\r\n\r\n<p><strong>The Adrenal Glands</strong></p>\r\n\r\n<p>The adrenal glands produce three types of steroid hormones: glucocorticoids (cortisol), mineralocorticoids (aldosterone), and androgens.</p>\r\n\r\n<p><strong>Glucocorticoids</strong>&nbsp;enable the body to respond and adapt to daily life stresses like emotional distress, exercise, trauma, illness and starvation. Cortisol, for example, plays a vital immune function role, to defend the body against bacterial or viral infections. However, continuous excessive levels of cortisol suppress the immune system leading to frequent infections.</p>\r\n\r\n<p>Aldosterone maintains the body&rsquo;s salt and water levels.</p>\r\n\r\n<p>Androgens, such as&nbsp;<a href=\"https://newcenturylabs.com/product/dhea-dehydroepiandrosterone-unconjugated/\"><strong>DHEA</strong></a>, testosterone and androstenedione, play an important role in the regeneration of body tissue, especially in the skin, bones and muscles. DHEA levels decline gradually as a person ages.</p>\r\n\r\n<p>For women, the adrenal glands are the major source of testosterone. Testosterone plays a role in the maintenance of lean body mass, bone density, skin elasticity, sex drive and cardiovascular health for both men and women.</p>\r\n\r\n<p>Adrenal imbalance can contribute to nervous and immune system dysfunction, weight problems, blood sugar irregularities, and high androgen levels.</p>\r\n\r\n<p><strong>Female Hormone Imbalance</strong></p>\r\n\r\n<p>Follicle-stimulating hormone (FSH) is a gonadotropin hormone secreted by the pituitary glands in the brain. FSH regulates the development, growth, and maturation of the female body. FSH and luteinizing hormone (LH), also secreted by the pituitary glands, work together in regulating the reproductive process.</p>\r\n\r\n<p>The ovaries produce many hormones. The most influential hormones are the estrogens (many hormones in this range) and progesterone, which interact to coordinate a woman&rsquo;s menstrual cycle during her reproductive years, along with testosterone. FSH and LH trigger hormone production in the ovaries.</p>\r\n\r\n<p>When any of the above hormones are imbalanced, symptoms may occur. Imbalances are most common during puberty and menopause, but can occur at any age. Imbalances can have far-ranging effects on the body, producing a variety of physical, emotional and cognitive changes. These changes cause symptoms like:</p>\r\n\r\n<ul>\r\n	<li>Irregular and or painful periods.</li>\r\n	<li>Periods that are longer, shorter, heavier or lighter than normal.</li>\r\n	<li>Hot flashes and night sweats.</li>\r\n	<li>Insomnia and other sleep disturbances.</li>\r\n	<li>Diminished sex drive.</li>\r\n	<li>Decreased fertility.</li>\r\n	<li>Vaginal dryness.</li>\r\n	<li>Irritability and mood swings.</li>\r\n	<li>Depression and/or anxiety.</li>\r\n	<li>Difficulty with concentration and/or memory, a symptom often described as &ldquo;brain fog.&rdquo;</li>\r\n	<li>Fatigue.</li>\r\n	<li>Unexplained weight gain, especially in the abdominal area, hips and thighs.</li>\r\n	<li>Skin changes, such as acne, thinning, dryness, oiliness and wrinkling.</li>\r\n	<li>Dry, brittle hair or loss of hair.</li>\r\n	<li>Loss of bone mass and muscle mass.</li>\r\n	<li>Bloating.</li>\r\n	<li>Excess facial and body hair.</li>\r\n	<li>Tender or fibrocystic breasts.</li>\r\n	<li>Urinary incontinence.</li>\r\n</ul>\r\n\r\n<p>If left untreated, female hormone imbalances can increase a woman&rsquo;s risk of developing diseases like heart disease and osteoporosis.</p>\r\n\r\n<p><strong>Male Hormone Imbalance</strong></p>\r\n\r\n<p><strong>Low testosterone and high estrogen</strong>&nbsp;is more and more found in men who go through hormone tests. Common symptoms are:</p>\r\n\r\n<ul>\r\n	<li>Excess weight, especially around the breasts, hips and abdomen.</li>\r\n	<li>Low libido, infertility and erectile dysfunction.</li>\r\n</ul>\r\n\r\n<p>If left untreated, this imbalance increases the risk of stroke and heart attack because of an increased risk of clotting. It also increases the risk of prostate cancer.</p>\r\n\r\n<p><strong>Low Testosterone</strong>&nbsp;causes:</p>\r\n\r\n<ul>\r\n	<li>Muscle weakness and poor recovery from exercise.</li>\r\n	<li>Fatigue and lack of energy.</li>\r\n	<li>Mood changes and depression.</li>\r\n	<li>Weak bones and osteoporosis as one ages.</li>\r\n</ul>\r\n\r\n<p><strong>Your Health Problems May be Caused by Hormone Imbalance</strong></p>\r\n\r\n<p>As you can now understand, hormones play a critical role in how we act, feel, and think. You also understand that many of today&rsquo;s health problems can be attributed to&nbsp;<em>hormone imbalance</em>. Whether you&rsquo;re trying to lose weight, avoid illness, or enhance cognitive focus, imbalanced hormones may be the first area you check. Your aim is to recreate hormone balances.</p>\r\n\r\n<p><strong>How a Hormone Test Can Help You</strong></p>\r\n\r\n<p>Many people have benefited from thyroid tests which have indicated an imbalance which has caused difficulty in weight loss. A simple blood test will help you too to discover if you have an imbalance somewhere. This will help your doctor to diagnose the cause of many of the health problems you may be having. As a result, you&rsquo;ll have a strong basis for correcting the imbalance through the use of diet, exercise or hormone supplementing.</p>\r\n\r\n<p>Take control of your health today. A simple blood test is the important initial step in determining if you are out of balance. You can take full advantage of the hormone tests that New Century Labs offer. New Century Labs offer direct-to-consumer tests, giving you full control of your health.</p>\r\n\r\n<p>Should the results indicate imbalance, you can take your test results to a doctor who can then prescribe a course of treatment. After you have begun your treatment program, a subsequent test can help you determine how effective your treatment is.</p>\r\n\r\n<p>You do not need to see your doctor first in order to have a test. If you have any of the symptoms listed above, you can order a test on our website. No need to wait in the queue and pay doctor&rsquo;s fees. You also avoid rejection of your claims by your insurance.</p>\r\n\r\n<p><strong>Our Tests are Affordable!</strong></p>\r\n\r\n<p>Our tests cost far less than you would pay if you went via your doctor&rsquo;s office. Our prices are highly discounted between 50% and 85%! The cost is so low&nbsp;and fully transparent&ndash;no surprise billing and now health insurance required.</p>\r\n\r\n<p><strong>Order a Test Today!</strong></p>\r\n\r\n<p>You can order your Hormone panels at the link below and get your results in 72 hours! No doctors order, no Co-pay and no germy clinics.</p>\r\n\r\n<h2><strong><a href=\"https://newcenturylabs.com/product-category/comprehensive-health-panels/\">Comprehensive Hormone Panels</a></strong></h2>\r\n\r\n<p><strong>Easy to Order too!</strong></p>\r\n\r\n<p>Click on the link below to see&nbsp;what Kim had to say about her experience:</p>\r\n\r\n<h2><strong><a href=\"https://www.youtube.com/watch?v=TlNw-ybTo-w\">Kims Experience</a></strong></h2>\r\n', 6, '7881481280097.jpg', 'Did you know your personality, your mood, your outlook in life, what we aspire to be, everything that sets that spark to motivation, our ability to combat unwanted', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests, ', 'New Century provides low cost medical lab tests online across the United States.', 'the-key-to-health-is-hormone-balance'),
(27, '2016-12-09 10:55:19', '2017-04-24 15:57:53', 1, 'Advanced Lipid Profile Test, Cardio IQ, Diabetes, Healthcare, Heart Disease, Lab, Lipid, Proactive, Stroke, thyroid', 1, 'Creating a more meaningful relationship with your provider', '<h2>Your physician should provide you with necessary resources to enhance your health.</h2>\r\n\r\n<p>Let&rsquo;s face its 2016, you don&rsquo;t need to drive to a local video store to rent a movie, you can sit on your couch and order one. You can pull out your cell phone and order an UBER within minutes anywhere you want. If you want to buy retail products, you can do so online from Amazon and have it delivered to you the very next day&mdash;this type of demand service is what we are now accustomed to. We can go on and on with companies who have identified problems in the market place who has found better quicker solutions for the consumer. But what about healthcare, and how has healthcare adapted to our current expectations, and how is healthcare system as a whole been identifying ways to help patient&rsquo;s rid disease? Identifying patient&rsquo;s frustrations and finding solutions has been improving, yet not at the same pace to modern times.</p>\r\n\r\n<p>There were over 52,000 applicants who applied for med school in 2015, up over 6% from the prior year, According to the Association of American Medical Colleges. The average time to be a practicing MD independently, after residency, is typically another 4 years. If you&rsquo;re one of those who got accepted in Med school in 2016, chances are by the year 2024 Healthcare technology will be more innovative and technologically advanced. The question is how do we measure success rates for innovative technology in the world of healthcare, is it less heart attacks, less cancer, less diabetes, less obesity, or better disease management? We believe the focus will continue to be better disease management and life saving devices to aid a heart attack and stroke victims, respiratory difficulties, and other lifesaving technologies for acute trauma.</p>\r\n\r\n<p>The reality is people are living longer, but living with a chronic disease. Rather than dying from your disease, you can just live with it. pharmaceutical technology has scientifically created the ability to keep you living as long as possible, but with other potential side effects&mdash;you could need other pharmaceutical drugs to manage your symptoms from side effects.</p>\r\n\r\n<p>Example let&rsquo;s talk about the number #1 type of drug in the market known to lower cholesterol and prescribed by your doctor. According to the&nbsp;<a href=\"http://www.cdc.gov/cholesterol/treating_cholesterol.htm\">CDC&nbsp;</a>if you previously had a heart attack or stroke, a Statin drug is given to you if your LDL cholesterol (Bad Cholesterol) level is 190 mg/dL or higher. You are 40&ndash;75 years old with diabetes and LDL cholesterol of 70 mg/dL or higher. You are 40&ndash;75 years old with a high risk for developing heart disease or stroke and LDL cholesterol of 70 mg/dL or higher. These cholesterol lowering drugs are known as statins do come with potentially harming side effects side effects to your health.</p>\r\n\r\n<p>Although we see many of these technological advancements as necessary tools to aid physicians not only to practice medicine but to manage chronic disease, at the end of the day YOU are the ultimate decision maker as to how you want to live your life. Are your comfortable popping drugs every day, or do you want to take charge of your life be 100% committed to your healthcare and avoid the possibility of being a pill popper. You have the choice to either empower yourself and become more involved with your healthcare by making healthy choices, or you can put yourself at risk of falling prey to potential disease. Think of disease as a robber, a home invader. If you leave the door unlocked, you are opening up the possibility of a criminal entering your home. Likewise, with disease, if you do the very best by maintaining a healthy proactive life style it makes disease very difficult to invade your body. We believe that most diseases start by lacking self-awareness, and education. Sometimes education isn&rsquo;t that easy to access, so we&rsquo;re here to provide you some knowledge as to how one may start.</p>\r\n\r\n<p>We think that providing patients with as many resources as possible can be the best advancement in healthcare and it starts with &ldquo;you&rdquo; and your physician. Both of you need to have a vested interested in your health. The average time a patient spends with their doctor is less than 15 minutes and patients are rushed out the door. What makes matters worse, patients are not offered the correct medical laboratory tests because health insurance companies are reluctant to cover claims. Even though 70-80% of all clinical decisions stem from lab testing, and disease strikes before a symptom appears. One of the only times your health insurance company will cover your lab tests are when you&rsquo;re symptomatic, or during your annual physical with a limited number of labs.</p>\r\n\r\n<p>We believe that the core fundamentals of our healthcare system is dependent on lab testing. Physicians absolutely cannot make a guaranteed diagnosis without the aid of a lab test result, in addition to keeping up to date with new and proven scientific research. Take your normal lipid panel that calculates your total cholesterol, LDL, HDL and Triglycerides. This basic test was invented over 40 years ago and is the gold standard for detecting cardiovascular disease. Even though statistic show that 50% of patients who end up in the ER for heart attacks had normal cholesterol results, yet there are more advanced cholesterol tests like&nbsp;<a href=\"https://newcenturylabs.com/product/cardio-iq-advanced-lipid-panel\">Cardio IQ Advanced Lipid Profile Test&nbsp;</a>that measures your Cholesterol particle size, however this test is not ordered by physicians and insurance doesn&rsquo;t normally cover it. Even though this test has much more clinical utility than the standard lipid test and helps aid the practitioner in the right direction, it&rsquo;s not ordered as often as it should.</p>\r\n\r\n<p>How about physicians not ordering thyroid panels for their patients where medical scientific research has proven that abnormal thyroid results could be the reason of very high cholesterol. The reality is when your doctor orders you the wrong tests, or tests they think you don&rsquo;t need, they may be putting you at risk. Perhaps you really didn&rsquo;t need that statin drug after all, maybe it was just your thyroid that need to be worked on.</p>\r\n\r\n<p>Institutionally physicians do not have a very good platform to match lab tests to symptoms, and lab testing isn&rsquo;t taught heavily in Med School, also insurance companies have so much weight on access and cost, and big Pharma has major influence as well too. How do you get out of this muck. The answer is simple, READ! Use the internet to your advantage, 70% of google searches have to do with healthcare related topics, ask your doctor why the ordered those tests and have them explain in detail how they are determining diagnosis and prognosis&mdash;at the end of the day it&rsquo;s your body, not theirs!</p>\r\n\r\n<p>The power is in your hands, leverage all the creditable resources out there to your advantage, if insurance and your doctor are denying you lab tests you think you need, seek all other alternatives, never take &ldquo;NO&rdquo; for a final answer, it can mean the difference between life or death.</p>\r\n\r\n<h2>NCL has a solution for you and your Doctor</h2>\r\n\r\n<p>Although the intention for the last hundred years has been to rid disease completely, this is just not the reality. As doctors have the advanced tools&nbsp;at their disposal, so do you. You can now order your own lab tests any day, any time, 24 hours a day, 7 days per week from your PC, or your cell phone, &nbsp;passing all the hurdles it takes to living a proactive lifestyle, and bypassing your insurance company denying you lab test claims. NCL has contracted with major diagnostic laboratories nationally allowing you access to over 8,000 lab tests from 50-90% off, on demand, on your terms! Your physician already knows this and needs to communicate this to you. Most people don&rsquo;t know you can order a lab test online. Communication with your doctor is key to better health, and ordering your own lab tests can be a tool for your doctor if insurance is out of the picture.</p>\r\n\r\n<p>New Century Labs has also contracted with physicians throughout the United States offering a unique platform for physicians to order blood work for their patients who either have no insurance, a high deductible,&nbsp;and when health&nbsp;insurance does not cover. We have found that at least a third of the patient need to pay cash for their lab tests and offering such services at extremely discounted prices has been seen as a useful tool for doctor and patient relationships. We have received calls from both physicians and patients who have expressed how much easier it is to be treated for health issues when access is available and pricing is low.</p>\r\n\r\n<p>When you want a lab test, you won&rsquo;t need to call your doctor&rsquo;s office and make an appointment, which could take weeks, wait in the waiting room with other sick patients, pay your co pay and doctors fee. You can have full control to order lab tests and become more proactive, taking charge of your health. This should be one of the answers to solving our healthcare crisis and identifying solutions to get patients more in control of their health. Allowing you the freedom and access to critical information about your body is critical so that communication with your doctor can become more meaningful. At the end of the day your doctor has the final say as to the right diagnosis, medication and prognosis by using lab test results as an aiding tool, so isn&rsquo;t it better to have the necessary tools at your disposal? NCL does several thousand lab tests per month from individuals who want answers about their body and we believe that proactive healthcare starts at the core fundamentals of diagnostic testing.</p>\r\n\r\n<p>Let us serve you with information that matters most to you!</p>\r\n', 6, '6871481292520.jpg', 'Your physician should provide you with necessary resources to enhance your health. ', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'creating-a-more-meaningful-relationship-with-your-provider'),
(28, '2016-12-09 11:18:17', '2017-04-24 16:04:05', 1, 'Lipid', 1, 'Why You Should Stop Getting Standard Lipid Tests', '<h2>Did you know that 50% of patients who wind up in the ER for heart attacks all had normal cholesterol results?</h2>\r\n\r\n<p>But I thought a normal cholesterol test meant I have a healthy heart, after all the results came back normal, right?</p>\r\n\r\n<p>Here&rsquo;s some hard facts, the standard lipid test was invented over 40 years ago, yet it&rsquo;s still used today as the gold standard to determine heart health, yet heart disease continues to be the leading cause of Death in America, causing 1 in every 3 deaths in the United States.<br />\r\nOne in every American Dies of cardio vascular Disease every 40 seconds, 635,000 Americans will have a heart attack every year, 280,000 Americans per year will have a recurrent heart attack, thus resulting in a massive spending influx on heart related issues.</p>\r\n\r\n<p>When results that come back with higher than normal cholesterol levels the standard protocol is to give a patient one of six prescription drugs potentially used to lower cholesterol levels, such as Lipitor or Crestor, so why the increase in our overwhelming population of heart attacks?<br />\r\nHowever, many doctors are still scratching their heads and still prescribing patients to take the standard cholesterol test, which won&rsquo;t detect which drug is the best for therapy, unless however, a more advanced lipid profile test is utilized such as The Cardio IQ created by Quest Diagnostics or the advanced LLP Plus test by SpectraCell. Both of which can actually hone in on how, why, where, and what treatment plan is needed to help save your heart from disease.</p>\r\n\r\n<p>What Advanced lipid profile tests measure are The LDL particle number, Small, Medium, large, and the LDL pattern (A or B), in addition to your LDL peak size, Apoliprotein B and Lipoprotein (a). This information could potentially save your life and can help you get back to a better state of heart health by picking the right pharmaceutical therapy prescribed by your doctor.</p>\r\n\r\n<p>The reality is disease happens to everybody before symptoms first appear; just because you&rsquo;re not symptomatic doesn&rsquo;t mean your clear of health related issues. NCL wants you to take charge of your health early, not after the fact where solutions become scarce.&nbsp;<a href=\"http://newcenturylabs.com/product/cardio-iq-advanced-lipid-panel\">Advanced lipid profile tests&nbsp;</a>today have made it easier than ever to catch potential heart disease early helping you take immediate action with your doctor.</p>\r\n\r\n<p>We believe if more doctors offered advanced lipid profile tests to patients, and insurance companies paid for them more frequently, Americans facing heart related risks would have a higher probability of avoiding heart attacks.</p>\r\n\r\n<p><strong>So what&rsquo;s been the set back? Pricing, accessibility, INSURANCE COMPANIES.</strong></p>\r\n\r\n<ul>\r\n	<li>Did you know even if you have insurance and met your deductibles your lab test may not be covered?</li>\r\n	<li>This is why Americans are constantly let down when the thought of being proactive about healthcare comes to play&ndash; we get slammed with a big denial when we&rsquo;re not symptomatic. Sounds a bit odd.</li>\r\n	<li>Wouldn&rsquo;t health insurance companies want you to request advanced testing to avoid a major healthcare payout?</li>\r\n</ul>\r\n\r\n<p>As puzzled as we are,&nbsp;<a href=\"http://www.newcenturylabs.com/\" target=\"_blank\">www.newcenturylabs.com</a>&nbsp;eliminates all the middlemen, making access to&nbsp;<a href=\"http://newcenturylabs.com/product/llp-plus\">life saving tests</a>more affordable and accessible, saving patents health, money and eliminating&nbsp;the feeling of uncertainty.</p>\r\n\r\n<p>When you&rsquo;re given the freedom to access vital information; when answers are no longer scares, healthy actions immediately follow. Become proactive and order lab tests on demand, on your terms!</p>\r\n', 6, '7881481282297.jpg', 'Did you know that 50% of patients who wind up in the ER for heart attacks all had normal cholesterol results?', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests, ', 'New Century provides low cost medical lab tests online across the United States.', 'why-you-should-stop-getting-standard-lipid-tests'),
(29, '2016-12-09 11:49:05', '2017-04-24 15:59:27', 1, 'Cancer, Diabetes, Heart Disease, Stroke', 1, 'Metabolic Syndrome', '<h1>The leading pathways to Death</h1>\r\n\r\n<h2>And simple examples to combat these killer illnesses.</h2>\r\n\r\n<p><a href=\"http://www.medicinenet.com/metabolic_syndrome/article.htm\">Metabolic Syndrome</a>&nbsp;is the name for a group of risk factors that raises your risk for<a href=\"http://www.heart.org/HEARTORG/Conditions/More/MyHeartandStrokeNews/Coronary-Artery-Disease---Coronary-Heart-Disease_UCM_436416_Article.jsp#.V4GeC4-cGhc\">&nbsp;Heart Disease</a>,&nbsp;<a href=\"http://www.diabetes.org/diabetes-basics/type-2/?loc=db-slabnav\">Diabetes</a>, stroke&nbsp;and other diseases, known in America as the leading causes of Death.</p>\r\n\r\n<p>The term &ldquo;Metabolic&rdquo; refers to all the processes in your body working together to create the energy that keeps you going. Now, let&rsquo;s link in your metabolism. Your metabolism is the rate at which your body&rsquo;s many processes function, and it can be low, high, or somewhere in the middle. When you&rsquo;re younger and more active, your metabolism can be high, making it easy to lose weight, but as you get older your metabolism slows down and you might put on a few extra pounds. Exercising will speed up your metabolism, and so does a good diet! Many factors come into play for high and low metabolism in people, so let&rsquo;s break this down even further. Compare a person who has a lot of fat under their skin vs someone who has a lot of muscle under their skin, those who have more muscle actually increase the number of calories they burn; &nbsp;on average it comes&nbsp;to&nbsp;6-10 calories per pound of muscle you gain, while one pound of fat burns about two calories per day at rest. Fat is not a great physical state to be in, and we&rsquo;re not just talking looks. Being overweight actually makes it harder to be healthier which means you will have to work 10x harder than someone with less body fat.</p>\r\n\r\n<p>Before we start selling you on exercise we want to circle back to &ldquo;<a href=\"http://www.medicinenet.com/metabolic_syndrome/article.htm\">metabolic syndrome</a>&rdquo; to demonstrate two life styles which&nbsp;act as a&nbsp;magnet to&nbsp;<a href=\"http://www.medicinenet.com/metabolic_syndrome/article.htm\">metabolic syndrome&nbsp;</a>and a deterrent to Metabolic syndrome, so let&rsquo;s talk about Bob and Jack:</p>\r\n\r\n<p>Jack is not a healthy diet extremist, but he maintains a healthy balanced diet, avoiding as much dairy out of his diet, eats his fruits and veggies with lean grass fed beef and chicken and gets his vitamins and minerals from supplements. He has a 9-5 job, but takes walks during his lunch break. Takes the stairs avoiding&nbsp;elevators&nbsp;to burn those calories, and doesn&rsquo;t let the daily stress of work, family life, and driving in traffic stress him out. He&rsquo;s proactive with his health care and checks in with his Doctor for routine and preventative checkups. Gym time is his time to unwind and release stress, he doesn&rsquo;t have a $200 a month gym membership its got everything he needs and Jack follows a stringent exercise routine from a great<a href=\"http://jcarlosfitlab.com/\">&nbsp;exercise program</a>&mdash; water and whey protein are by his side. Jack also focuses on exercising his brain by simply reading and learning new things, laughing with friends and is always up for a good hike in the mountains. Jack loves his life and life around him.</p>\r\n\r\n<p>Bob is also a go get&rsquo;em type of guy, he&rsquo;s known as a take charge guy at work and loves his job. He has a 9-5 job like Jack with a family and also has his daily routine. Bob claims he prefers to live for the &ldquo;now&rdquo; so he doesn&rsquo;t have to stress about the future. At lunch Bob can easily eat cheese burgers and pizza every day with no regrets. Bob admits he can be a workaholic and prefers to eat at his desk. No time for the gym he says and weekends are just a stay at home event watching sports. Bobs wife is concerned for his health but Bob claims he will see his doctor when he has time. Bob stands 5ft&nbsp;11&Prime;&nbsp;tall and weighs over 285 pounds. He says his energy and concentration is best utilized while he is sitting and feels out of breath when he goes on walks, let alone the stairs.</p>\r\n\r\n<p>The reality is you have a choice in life you can be like Bob, or like Jack. You can live for the moment, or prepare for the future. You can be proactive, or reactive and hope for the best. You can leverage the internet for knowledge about ways to make healthy life style changes or you can sit on the couch and watch sports for 8 hours a day.</p>\r\n\r\n<p>The common denominator with Bob is behavioral avoidance with the most common excuse &ldquo;I don&rsquo;t have time, I&rsquo;m too tired, &ldquo;eating unhealthy is too easy to access&rdquo;, sitting at a desk is easier than taking a walk. Unlike Bob, Jack makes it a habit to show up and persevere with daily activities; in a nut shell this motivates Jack to continue to make healthier life style changes.</p>\r\n\r\n<p>Jacks metabolism is working at a much higher rate making weight gain difficult to enter. He pumps his heart at the gym and moves blood flow through his arteries. His diet is low on sugar and high on fiber, forgiving his pancreas from over working and reducing the risk of diabetes. His stress levels are low reducing a spike in cortisol levels, combating high blood pressure. His doctor orders lab tests and Jack likes to track his lab test results to prior lab tests, &nbsp;making sure his blood chemistry levels are optimal.</p>\r\n\r\n<p>The path that Bob has chosen&nbsp;will one-day surprise himself and his family with disease, as Bob likes to live for the now and not the future, even though Bobs Doctor advised him that disease strikes before symptoms appear.&nbsp; Bobs diet is causing mini cholesterol particles to hit his arterial wall, potentially leading to a heart attack and stroke. His choice to be inactive is also causing limited blood flow throughout the body, making it easier to kill off his ability to fight off&nbsp;health risks and welcome disease.</p>\r\n\r\n<p>Bob is now entering the deadly path of&nbsp;<a href=\"https://www.heart.org/HEARTORG/Conditions/More/MetabolicSyndrome/Prevention-and-Treatment-of-Metabolic-Syndrome_UCM_301927_Article.jsp\">Metabolic Syndrome</a>. NCL wants to be very clear with our readers that neglecting your health is no different than walking through a war zone and expecting nothing will happen to you. When you neglect your health, you welcome every opportunity for disease to strike, and its not just you who suffers. Your family and friends, your health insurance premiums, in addition or health insurance premiums across the board. The four leading causes of death in America&nbsp;are&nbsp;Heart disease, Diabetes, Stroke and Cancer. All of which can be eliminated by simply making an immediate behavioral change. Become more proactive minded and less reactive minded.</p>\r\n\r\n<p>It&rsquo;s never too late to make healthier choices, so work on getting that higher metabolism, change your mind set, check your blood chemistry levels often, get to know the real you from inside out and be positive with yourself and others and make it a habit!</p>\r\n\r\n<p>We always strive to be the best quality Lab Service for&nbsp;all your lab testing needs, so&nbsp;let us&nbsp;make this experience comforting and empowering.</p>\r\n\r\n<p>New Century Labs believes&nbsp;proactive healthcare is the best health care and it starts&nbsp;at the core fundamentals of diagnostic testing.</p>\r\n\r\n<p>Order your&nbsp;<a href=\"https://newcenturylabs.com/product/diabetes-risk-panel-with-score\">Diabetes Risk Panel which comes with an 8 year risk of developing diabetes for only $29.00</a></p>\r\n\r\n<p>Test Includes:</p>\r\n\r\n<ol>\r\n	<li>Cardio IQ&reg; Glucose</li>\r\n	<li>Cardio IQ&reg; Hemoglobin A1c</li>\r\n	<li>Cardio IQ&reg; Cholesterol, Total</li>\r\n	<li>Cardio IQ&reg; HDL Cholesterol</li>\r\n	<li>Cardio IQ&reg; Triglycerides</li>\r\n	<li>Cardio IQ&reg; Non-HDL</li>\r\n	<li>Calculated Components</li>\r\n	<li>Cardio IQ&reg;&nbsp;<strong>8 Year Diabetes Risk!</strong></li>\r\n</ol>\r\n', 6, '9971481286812.jpg', 'Metabolic Syndrome is the name for a group of risk factors that raises your risk for Heart Disease, Diabetes, stroke and other diseases, known in America as the leading causes of Death.', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'metabolic-syndrome');
