(30, '2016-12-09 11:54:37', '2017-04-24 16:03:21', 1, 'Hormone, thyroid', 1, 'Your Thyroid can throw you off Balance', '<p>Thyroid gland is the most important gland in the body, after the pituitary gland. It helps in retaining the energy that each cell has. A deficiency or dysfunction of the thyroid gland results in adverse effects for both men and women. There are two ways in which this happens- hypothyroidism and hyperthyroidism. The former is the most common ailment.</p>\r\n\r\n<p>Have you ever felt so tired that you couldn&rsquo;t make it through the day? Have you been noticing unnecessary and sudden weight gain? Are you experiencing hair fall? These are all some of the symptoms that indicate a thyroid problem.</p>\r\n\r\n<p><strong>Signs &amp; Symptoms:</strong></p>\r\n\r\n<p>Women are more prone to thyroid but men are equally at risk too. The thyroid awareness has increased tremendously lately that many women are rushing to their doctors to find out if they have the condition too.</p>\r\n\r\n<p>When some of them are lucky enough to have caught it early, there are others who get unlucky. Most of the individuals are always borderline hypothyroid. Taking this as a sign from the tests conducted, doctors prescribe pills and medicine that fight the condition. This in turn makes you a victim for the condition, when you did not have it in the first place.</p>\r\n\r\n<p>Here are some of the signs that men and women can watch out for:</p>\r\n\r\n<ul>\r\n	<li>Sudden weight gain/loss.</li>\r\n	<li>Unable to go through regular workout.</li>\r\n	<li>Extreme fatigue.</li>\r\n	<li>Mood swings.</li>\r\n	<li>Poor memory retention.</li>\r\n	<li>Constipation</li>\r\n	<li>Depression</li>\r\n	<li>Poor skin, nails and hair.</li>\r\n	<li>Sore muscles.</li>\r\n	<li>Trouble in concentrating.</li>\r\n	<li>Irregular menstrual cycle.</li>\r\n</ul>\r\n\r\n<p><strong>Blood tests&nbsp;</strong>and&nbsp;<strong>hormone tests&nbsp;</strong>are mostly the best way to conclude if you suffer from hypothyroidism. Consult your doctor to know more. Once you consult your doctor, you can&nbsp;<strong>order your lab tests online</strong>.</p>\r\n\r\n<p><strong>Fighting Hypothyroidism:</strong></p>\r\n\r\n<p>Regular&nbsp;<strong>wellness check</strong>&nbsp;is something you can do to be more proactive about your health. You can run yourself through&nbsp;<strong>blood tests and hormone tests&nbsp;</strong>every once in a while to make sure you haven&rsquo;t missed any symptoms (just in case).&nbsp;<strong>Proactive healthcare&nbsp;</strong>is more beneficial compared to diagnosing at a much later stage. Fighting thyroid is not impossible. With time, you can ward off your conditions easily and continue to live a healthy life.</p>\r\n\r\n<p>When a&nbsp;<strong>hormone test&nbsp;</strong>is run to check for thyroid related problems, men and women are tested for more than one hormone. This gives doctors a complete understanding of your symptoms. Men with thyroid issues are prone to Erectile Dysfunction and other infertility problems. To know more about the tests and ordering one online,&nbsp;<a href=\"https://newcenturylabs.com/product/basic-male-health-check\">click here.</a></p>\r\n\r\n<p>Women with thyroid issues face problems with their menstrual cycle and other fertility disorders. To stay on the safe side,&nbsp;<a href=\"https://newcenturylabs.com/product/basic-female-hormone-panel\">click here to know more about tests.</a></p>\r\n', 6, '3051481284477.jpg', 'Thyroid gland is the most important gland in the body, after the pituitary gland. It helps in retaining the energy that each cell has.', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'your-thyroid-can-throw-you-off-balance'),
(32, '2016-12-09 12:05:28', '2017-04-24 15:58:14', 1, 'Vitamin D', 1, 'Dangers of Vitamin D Deficiency', '<h2><strong>Reasons You Should Be Tested For Vitamin D</strong></h2>\r\n\r\n<p>As winter approaches, you want to have the right levels of Vitamin D in your blood! Here is why vitamin D is important for your health.</p>\r\n\r\n<p><strong>Prevention of flu:</strong>&nbsp;Vitamin D deficiency can plummet your&nbsp;immune system increasing your risk of getting&nbsp;infections and inflammation during the fall-winter flu season. As your strategy should be to prevent&nbsp; the winter flu, you want to increase your intake of Vitamin D supplements if your D blood levels show below normal range. It is important to get your blood tested for vitamin D levels so you know if you need supplements.</p>\r\n\r\n<p><strong>Prevention of depression:</strong>&nbsp;Low levels of Vitamin D are associated with depression and can attack your sex hormone causing low estrogen in women and low testosterone in men, which can cause mood changes and potential depression, hence why some men tend to have increased libido in the summer time than the winters.</p>\r\n\r\n<p><strong>Reduction of muscle aches and pain:</strong>&nbsp;Vitamin D normalizes blood calcium which softens and relaxes tight shortened muscles. It is particularly useful for menstrual cramps.</p>\r\n\r\n<p><strong>Reduction of the risk of cancer:</strong>&nbsp;Vitamin D normalizes cell to cell communication, reduces uncontrolled cell growth and allows cells to develop into normal cells with a normal life cycle. Deficiency of Vitamin D may increase risks of many cancers. Several studies have shown that low levels of Vit D have a increased risks of developing bladder cancer, researchers have also found that cells lining the bladder activate and respond to vit D. When this key nutrient is taken the immune system response stimulates, where the immune system can destroy abnormal cells they develop into cancer.</p>\r\n\r\n<p><strong>Prevention of Cardiovascular diseases:</strong>&nbsp;Vitamin D has been shown to protect the lining of your blood vessels hence reducing risks of high blood pressure, heart diseases and stroke.</p>\r\n\r\n<p><strong>Reducing&nbsp;Diabetes&nbsp; risk:</strong>&nbsp;Research has invariably found low levels of Vit D&nbsp;could increase the chance of &nbsp;diabetics causing insulin resistance.</p>\r\n\r\n<p><strong>Prevention of Autoimmune Diseases:&nbsp;</strong><strong>Vit D reduces risk of getting autoimmune diseases like Lupus, Multiple Sclerosis, Rheumatoid Arthritis, and Hashimoto&rsquo;s Thyroiditis.</strong>&nbsp;Research found that Vit D reduces the risk of Multiple Sclerosis at optimal levels.</p>\r\n\r\n<p><strong>Strengthen bones:&nbsp;</strong><strong>Vit D reduces your risk of bone fractures, bone loss and osteoporosis</strong><strong>.</strong>&nbsp;Deficiency is associated with rickets, which is common among dark skinned people.</p>\r\n\r\n<p><strong>The body can make Vitamin D!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Obviously&nbsp;this key nutrient &nbsp;is very important for health. The human body can make Vit D when the skin is exposed to sunlight. But a lot of people suffer from deficiency of vit D because:</p>\r\n\r\n<ul>\r\n	<li>They spend more time indoors during working hours.</li>\r\n	<li>When they go outdoors they apply sunscreen which blocks Vit D production in the skin.</li>\r\n	<li>Dark skinned people make less Vit D than those with light skin.</li>\r\n	<li>Aging skin makes 75 percent less Vit D&nbsp;than young skin.</li>\r\n	<li>In the northern hemisphere, there is little or no sun exposure in winter.</li>\r\n</ul>\r\n\r\n<p>Blood levels of Vitamin D3 associated with OPTIMAL HEALTH are in the range of 70-120nmol/L.</p>\r\n\r\n<p>To prepare for the upcoming winter season when there is little or no sun, get your blood tested for vit D levels, know where you stand and be proactive.</p>\r\n\r\n<p><strong>Be Proactive. Order Your Blood Test Online!</strong></p>\r\n\r\n<p>Here is the good news! You can order your blood test online! New Century Labs provide this convenient service so you can order your test easily! You do not need to go through a doctor. You can order the test yourself! No sitting in a queue. No doctor&rsquo;s fees or Copay. It&rsquo;s quick. It&rsquo;s convenient. It&rsquo;s affordable.</p>\r\n\r\n<p>You can order your&nbsp;vit &nbsp;D test for only $29 by clicking on the link&nbsp;below easily and quickly. Your lab order will be delivered to you by email in less than 4 hours. Simply print the order and take it to the nearest outlet. You will receive your results confidentially in just 3 business days.</p>\r\n\r\n<p>Why pay $99 for the same test when you can get it here for a fraction of the price.</p>\r\n\r\n<h3><strong><a href=\"https://newcenturylabs.com/product/vitamin-d-blood-test/\">New Century Labs Vitamin D Test</a></strong></h3>\r\n', 6, '8761481285128.jpg', 'As winter approaches, you want to have the right levels of Vitamin D in your blood! Here is why vitamin D is important for your health.', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'dangers-of-vitamin-d-deficiency'),
(33, '2016-12-09 12:15:49', '2017-04-24 15:58:36', 1, 'Liver Disease, Liver Panel, Liver Test', 1, 'Healthy Liver Healthy Life', '<h1><strong>Take care of your liver</strong></h1>\r\n\r\n<h2><a href=\"https://vimeo.com/122387548\">Click to watch trailer </a></h2>\r\n\r\n<p>Our blog is inspired by the movie&nbsp;<strong>&ldquo;</strong><a href=\"http://sugarcoateddoc.com/\"><strong>Sugar Coated&rdquo;&nbsp;</strong></a>created by Michele Hozer. As the key discussion of this movie was sugar, and all of its toxic harms, we wanted to focus on the body&rsquo;s processing plant, the &nbsp;Liver, and how Neglecting your liver will bankrupt your life,&nbsp; and overall well-being. Your liver can be harmed&nbsp;overtime, with almost no warning signs and no symptoms. Often times people wait until a symptom starts appearing before they take action&ndash; often times it&rsquo;s too late. When we think of liver disease, we immediately think of alcohol abuse, but that&rsquo;s not always 100% the case. Your liver can get diseased from simply putting the wrong types of food in your mouth. When you eat a bad diet, cheese burgers, pizza, soda pop, sit around all day and lacking exercise, your liver can become fat making it much harder for your liver to filter out all the bad stuff.</p>\r\n\r\n<p><a href=\"http://www.liverfoundation.org/education/liverlowdown/ll1013/bigpicture/\">1 in 10 Americans have some form of liver disease every year</a>. Every year 19,500 die from liver cancer, 49,500 Die from Cirrhosis, (Cirrhosis occurs in response to damage to your liver.) In the world liver cancer deaths per year amounts to 745,000 and over 1,000,000 from Cirrhosis. Fatty liver disease from alcoholic and non alcoholic fatty liver disease on an upward trend:</p>\r\n\r\n<p>Alcohol consumption is the leading cause of FLD (Fatty liver Disease) (25%-35% of the general population and Non-alcoholic &nbsp;Fatty Liver Disease currently affects 25% of Americans and expected to reach 50% by 2030.</p>\r\n\r\n<p>This is a disease that has to do with what we put into our mouths, we call this&nbsp;<a href=\"https://www.atkins.com/how-it-works/library/articles/the-sad-consequences-of-the-standard-american-diet\">SAD (Sad American Diet.)</a>&nbsp;The choice is clear, neglect your liver and your liver will neglect you!</p>\r\n\r\n<p>The best way to attack &ldquo;neglect&rdquo; is to become more in tune with how your organs function, their purpose, how they gets effected and how they can add more years to your life!&nbsp; YES your liver should be treated like your own child, love, care, and respect and NCL has some pointers &nbsp;that will make you think about your liver on a more conscientious state.</p>\r\n\r\n<h2>Lets jump into your liver and take a look!</h2>\r\n\r\n<p>Your&nbsp;<strong><a href=\"http://www.liverfoundation.org/\">liver&nbsp;</a></strong>is one of the heaviest organs in the body weighing in at slightly over 3 pounds, yes 3 pounds, and it&rsquo;s in charge of&nbsp; many different processes and functions in the body. Think about your liver like a factory.&nbsp; A factory has a warehouse, manufacturing capabilities, and can process material into a finished product, sending off finished goods to the end user for utilization&ndash;this process is exactly how your liver functions.</p>\r\n\r\n<p>Everything you eat filters through your liver, it metabolizes nutrients and stores them,&nbsp;even detoxifies your system of harmful &nbsp;toxins from the blood. This is of course when your liver is healthy&ndash;everything you eat has to filter through your liver.</p>\r\n\r\n<p>If you build fat in your liver it won&rsquo;t be able to filter out toxins and break down essential vitamins and key nutrients.&nbsp;When you have a fatty liver,&nbsp;it&nbsp;cannot get normal blood supply, which can cause all kinds of damage to your body.</p>\r\n\r\n<h3><strong>Your liver is really your bodyguard.</strong></h3>\r\n\r\n<p>When you eat food your liver strips out important vitamins and nutrients, feeding your cells with those needed nutrients and then &nbsp;storing them up until your body is in need again. For example, with carbohydrates your body breaks it down and converts it to sugar for your&nbsp;body&rsquo;s energy use. When you have excess of what your body no longer needs, your liver will store them and use them for later use&ndash; sounds like a good neighbor! Your liver is actually a genius, it can detect toxins and immediately and rid them kidneys and into your intestines.</p>\r\n\r\n<p>Through the manufacturing side, your liver has a production component, everything from producing blood plasma protein, which transports fatty acids and helps form blood clouts, to cholesterol production which help your body to create hormones, not to mention vitamins and substances that help in the aid of digestion.</p>\r\n\r\n<p>The most vital product that your liver manufactures is that oozing green looking substance, it&rsquo;s called Bile. Like an Eco-friendly treatment plant your liver uses cells called Hepatocytes to convert toxic waste products, A&nbsp;hepatocyte&nbsp;is a cell of the main&nbsp;parenchymal&nbsp;tissue of the&nbsp;liver. Hepatocytes make up 70-85% of the liver&rsquo;s mass.</p>\r\n\r\n<p>Bile is then funneled into a small container below the liver called the Gallbladder before being dumping into the intestine which then break down fats, destroys microbes, and helps stomach acids. Bile also helps carry other toxins and unnecessary by products from the liver out of the body, again, what an amazing neighbor!</p>\r\n\r\n<p>Your liver really is a factory in charge of multiple functions, helping keep your body strong and healthy. However, such a complex system needs tender loving care, self awareness, and a proactive mind set. The ability to look at soda pop and make a rational judgment call is key. You are no longer in a state of neglect, you are in charge of the situation, the situation is not in charge of you.</p>\r\n\r\n<p>When liver damage strikes, its often too late for treatment, or too difficult for treatment. The reality is disease happens before any symptoms appear and the best way to check your liver is simply being more&nbsp;proactive with your health care. Getting to know the real you from inside out. Getting critical information about your body before it&rsquo;s late.</p>\r\n\r\n<p>70-80% of all clinical decisions come from lab testing and NCL supports those who are proactive with their healthcare, who are looking for ways to improve health and wellness.</p>\r\n\r\n<p>The best time to check your liver health is when you don&rsquo;t have signs and symptoms, this can be done through 1 simple blood draw. NCL makes getting a test affordable, convenient, and fast.&nbsp;You no longer need to call to make an appointment at your doctor&rsquo;s office, no long waiting rooms, no co-pays, no need to deal with pesky insurance companies. Simply order online, from your PC or your cell phone. Pick your lab tests and check out with your credit card. Your lab order will be emailed to you&ndash; you are now ready to&nbsp;get your blood drawn&ndash; we&rsquo;ll show you where to get your blood drawn nearest you. &nbsp;Your results then get emailed to you privately and securely. If you need to take your results to your doctor to have a meaningful conversation about your results&nbsp;please do so we recommend it.</p>\r\n\r\n<p>Remember all it took was you becoming more self aware&ndash;just 1 blood draw can change your life. Knowledge is power and when you get critical information about your body, you begin to make positive changes.</p>\r\n\r\n<h2>Appreciate what the liver does for you!</h2>\r\n\r\n<p><strong>Ordering these tests can help you and your doctor understand your liver health, so we made ordering your liver function test super easy and super affordable:</strong></p>\r\n\r\n<p><strong><a href=\"https://newcenturylabs.com/product/hepatic-function-panel\">Hepatic Function panel $15.00</a>&nbsp; &nbsp;&nbsp;</strong></p>\r\n\r\n<h3><strong>This test includes:</strong></h3>\r\n\r\n<p><strong>-Total Protein</strong></p>\r\n\r\n<p><strong>-Albumin</strong></p>\r\n\r\n<p><strong>-Globulin (calculated)</strong></p>\r\n\r\n<p><strong>-Albumin/Globulin Ratio (calculated)</strong></p>\r\n\r\n<p><strong>-Total Bilirubin</strong></p>\r\n\r\n<p><strong>-Direct Bilirubin</strong></p>\r\n\r\n<p><strong>-Indirect Bilirubin (calculated)</strong></p>\r\n\r\n<p><strong>-Alkaline Phosphatase</strong></p>\r\n\r\n<p><strong>-AST</strong></p>\r\n\r\n<p><strong>-ALT</strong></p>\r\n\r\n<p><strong><a href=\"https://newcenturylabs.com/product/cbc-includes-differential-and-platelets\">Complete blood count (CBC) $15.00</a></strong></p>\r\n\r\n<h3><strong>Test Includes:</strong></h3>\r\n\r\n<p><strong>Platelet count The number of red blood cells (RBC count)</strong></p>\r\n\r\n<p><strong>The number of white blood cells (WBC count)</strong></p>\r\n\r\n<p><strong>The total amount of hemoglobin in the blood The fraction of the blood composed of red blood cells (hematocrit)</strong></p>\r\n\r\n<p><strong>Average red blood cell size (MCV)</strong></p>\r\n\r\n<p><strong>Hemoglobin amount per red blood cell (MCH)</strong></p>\r\n\r\n<p><strong>The amount of hemoglobin relative to the size of the cell (hemoglobin concentration) per red blood cell (MCHC)</strong></p>\r\n\r\n<p><strong><a href=\"https://newcenturylabs.com/product/gamma-glutamyl-transferase-ggt\">GGT $15.00</a></strong></p>\r\n\r\n<p><strong>Elevated GGT is found in all forms of liver disease.</strong></p>\r\n', 6, '4231481294155.jpg', 'Our blog is inspired by the movie Sugar Coated created by Michele Hozer. As the key discussion of this movie was sugar, and all of its toxic harms, ', 0, 0, 'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,', 'New Century provides low cost medical lab tests online across the United States.', 'healthy-liver-healthy-life');
