(35, '2017-03-25 03:27:12', '2017-04-24 15:57:09', 1, 'Cardio IQ Test ', 1, 'This Blood Test Can Help Prevent a Heart Attack ', '<p><strong>Knowing Your LDL Particle Size Can Help Prevent a Future Heart Attack </strong></p>\r\n\r\n<p>When you measure your lipids annually you&rsquo;re just getting what is traditionally thought of as one of the many preventative blood tests, which measure Total Cholesterol, basic LDL (BAD) HDL (GOOD) and total Triglycerides. What the blood test isn&rsquo;t reporting is the actual particle sizes, such as your LDL particle size.</p>\r\n\r\n<p>Knowing your LDL particle size can be a much stronger indictor of cardiovascular events, which is only found in advanced lipid profile tests.</p>\r\n\r\n<p>Statists show that 50% of patients who ended up in the ER due to a heart attack event had normal lipid panels. Studies have shown the importance of&nbsp;LDL-particle size.&nbsp;Research have shown that folks with small LDL particles&nbsp;have a much greater risk of coronary heart disease, where as a large and fluffy type of LDL is thought of the most protective type of LDL size&mdash;information not found in standard lipid tests.</p>\r\n\r\n<p><strong>LDL Particle size does matter</strong></p>\r\n\r\n<p><img height=\"200\" src=\"data:image/png;base64,\" width=\"624\" /></p>\r\n\r\n<p>Our liver will produce anywhere from 1-2 grams of cholesterol per day! Cholesterol production comes from our diet, stress (high cortisol) and genetics.&nbsp; Production can decrease when we eat a healthy diet, stress less, and live in healthy environments.&nbsp; Cholesterol is necessary though to produce vitamin D, steroid hormones, memory function, and hormone balance. However, as small LDL particles flows through your arterial walls, it can begin to increase inflammation in your arteries causing stroke, causing plaque buildup, reducing blood flow to your heart.</p>\r\n\r\n<p><strong>Hidden Cardiovascular Risk </strong></p>\r\n\r\n<p>With basic Cardiovascular testing, results can&rsquo;t come close to telling your doctor your risks to heart disease as advanced lipid tests. The question is why are physicians not offering advanced lipid profile testing to their patients? The answer is the high cost and extensive interpretation of results. Right now, when you ask your doctor for an advanced lipid profile test most likely your insurance company will not cover these tests, leaving you with a high bill in the hundreds. NewCenturyLabs.com has advanced lipid testing available for a fraction of the cost so that your doctor can help reclassify your risk to heart disease.</p>\r\n\r\n<p><strong>The Cardio IQ Test Can Help Identify Your Cardiovascular Risks</strong></p>\r\n\r\n<p>The <a href=\"https://www.newcenturylabs.com/product/42\"><strong>Cardio IQ&reg; Advanced Lipid Profile Test </strong></a>(92145) offered by New Century Labs and powered by Quest Diagnostics for just $99.00 is developed to help uncover the possible hidden risks to your cardiovascular health. Using the results of your test(s), your doctor will be able to develop a plan to set goals and treatment strategies to help reduce your overall cardiovascular risk.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 6, '5811490640865.jpg', 'Knowing Your LDL Particle Size Can Help Prevent a Future Heart Attack', 0, 0, 'LDL, Cardio IQ Advanced Lipid Profile Test, 92145, Quest Diagnostics, Vap Test, Blood Test, ', 'The Cardio IQ Advanced Lipid Profile Test (92145) offered by New Century Labs and powered by Quest Diagnostics for just $99.00 ', 'this-blood-test-can-help-prevent-a-heart-attack');
