(36, '2017-07-24 06:02:30', '2017-07-24 06:02:30', 1, 'Tick, lyme disease test', 1, '2017 Tick and Lyme Disease Warning ', '<p><span style=\"font-family: roboto,helvetica neue,helvetica,arial,sans-serif;\"><span style=\"font-size: 18px;\"><span style=\"margin: 0px;\"><font color=\"#000000\">Worried about Lyme Disease? There&rsquo;s a cheap blood test for that.</font></span></span></span></p>\r\n\r\n<p>The CDC, Center of Disease Control is warning about an influx of swarming Ticks throughout the United States, spreading Lyme Disease. But there&rsquo;s a double-shot of bad news that comes along with the influx.<br />\r\n<br />\r\nA new, and possibly fatal, tick-borne illness called Powassan, has arrived and this summer they are here, causing painful swelling in the brain killing 10% of people infected, or causing permanent brain damage. Powassan is much different than contracting Lyme Disease as Lyme disease can be treated if caught early, unlike Powassan.<br />\r\n<br />\r\nThere is a report of 30,000 confirmed cases per year, but there are 10-15X more unconfirmed cases of Lyme disease in the United States according to the CDC in upwards of 300,000 to 500,000 annually.<br />\r\n<br />\r\n<strong>Influx in ticks in 2017 you ask?</strong><br />\r\nThe mice population is increasing, which is helping Ticks spread their sinister love. Mice and some other small creatures carry around a little bacterium shape, that looks like paisley pasta under a scope.<br />\r\nThe mice then pass it to the Tick, then the Tick passes it to a person when it bites. Ticks can easily jump from a tree as you pass by, or even a bush, making its way to your skin. Lyme causes fevers, arthritis, flu like symptoms, and in bad cases it damages the heart quickly.<br />\r\n<br />\r\nGoing back in time to the 80&rsquo;s and early 90&rsquo;s Lyme disease was confined by just a few areas in the United States like Southern New England and Western Wisconsin, but now ticks have swarmed all over the country primarily in the eastern part of the US, but with heavy pockets in the Western part of the US too; up a whopping 400% increase than last year.<br />\r\n<br />\r\n<strong>Deep thought time.</strong><br />\r\nOften, we think catching Lyme disease happens only when you&rsquo;re out on a hike or camping in the woods, this in fact is <strong>NOT </strong>true. When you cut down trees for various types of commerce, such as a new housing development, to name one, you tend to disrupt the eco system. Take a forest or a farm that has been fragmented. When you have larger animals, who hunt for little mice those predators, who don&rsquo;t do much breeding, are dominant in this undisrupted landscape. Predators such as foxes, coyotes, large birds like owls and hawks, will find an easy catch like a mouse for a fast meal. But predators in developed land tend to vanish allowing mice to multiply and thrive, and especially in new suburban developments&mdash;they crank out babies like no body&rsquo;s business; mice are chronically infected with Lyme and covered in Ticks&mdash;hence creating a Lyme factory.<br />\r\nTherefore, if you think you&rsquo;re at risk just when you&rsquo;re camping, think again&mdash;you are at the same risk as you garden or even walking your dog in the neighborhood.<br />\r\nIt&rsquo;s often hard to spot a Tick attached to you, as Ticks attach behind your ears, back of neck, armpits and even the growing area, however there is a way to pluck them off. The key is to not pull them off too fast as their heads can get stuck into your skin.<br />\r\n<br />\r\n<strong>And the good news is.....</strong><br />\r\nThere is cure for Lyme disease, but it depends on how fast you get treated, the faster the better.<br />\r\nAnd knowing if you are infected with Lyme Disease is done through 1 single drop of blood. Access to getting your blood tests can be as simple as ordering blood test right here.<br />\r\nThe test is called: <strong><a href=\"http://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=ea77e959d0&amp;e=7ebc60f9f5\" target=\"_blank\">Lyme Disease Antibody with Reflex&nbsp;to Blot (IgG, IgM)</a></strong> Sounds like a mouth full but it&rsquo;s very comprehensive and its dirt cheap, detecting positive/negative Lyme disease just after contact and as far out as many years if you think you have it.<br />\r\n<br />\r\nOften, Doctors miss the mark when diagnosing patients with Lyme disease because it can mimic many other more common chronic diseases, such as the common Flu, or even arthritis, and genetic heart disease. Hence why the CDC believes that cases in the US is more like 300,000-to 500,000 per year not the stated 30,000.<br />\r\n&nbsp;<br />\r\n<strong>Look for the Lyme test with Antibodies?</strong><br />\r\nAntibodies are simply proteins that your body makes when it responds to a foreign, or even harmful ingredients, called <strong>antigens</strong>. The most common antigens include: bacteria, viruses, fungi, and even chemicals. Your body will start to produce &ldquo;antibodies&rdquo; when you are infected Lyme (Borrelia burgdorferi) the bacterium that causes Lyme disease. These Lyme disease-specific antibodies will show in your blood test and you will be positive. Likewise, if you have never been exposed to&nbsp;Borrelia burgdorferi, (Lyme) you will not have any Lyme disease antibodies in your system; In this case, your test will be negative.<br />\r\n<br />\r\nIf you feel you may have Lyme disease, get tested fast and get treatment ASAP, often times it&rsquo;s as simple as taking a specific type of heavy duty antibiotics, prescribed only by your treating Medical Doctor.<br />\r\nSince Lyme disease is difficult to diagnose and you&rsquo;re wondering why you&rsquo;re feeling tired, restless, have the flu, headaches, joint pain or generally unhealthy, Its super easy to rule out Lyme disease through a simple&nbsp;blood test, that way you can rule out this devastating disease.<br />\r\n<br />\r\n<strong>Remember health and wellness starts at the core fundamentals of getting to know the real&nbsp;&quot;you&quot; from inside out.&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nJoin the movement&nbsp;at New Century Labs&nbsp;and experience the difference&nbsp;</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;</strong><strong>Be a Proactive Warrior!</strong><br />\r\n&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 12, '6281500876150.jpg', 'Worried about Lyme Disease? Theres a cheap blood test for that.', 0, 0, 'tick,lyme disease,blood tests', 'If you feel you may have Lyme disease, get tested fast and get treatment ASAP, often times its as simple as taking a specific type of heavy duty antibiotics, prescribed only by your treating Medical Doctor.', 'tick-lyme-disease-blood-test'),
(37, '2017-09-04 04:42:22', '2017-09-04 05:50:22', 1, 'Blood tests ', 1, 'The Dangers of Vitamins ', '<h1>The Dangers of taking too many vitamins and supplements</h1>\r\n\r\n<h2>Water soluble vs fat soluble&nbsp;</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There&rsquo;s vitamin supplement stores in every city and every&nbsp;grocery aisle, you don&rsquo;t need a doctor&rsquo;s prescription to access them. You read taking Vitamin B-12 is great for nerves and you also read that taking Vitamin E is great for your skin. Do you really know what&rsquo;s truly happening to your body when you stare down that vitamin bottle and realize you&rsquo;re on your 25<sup>th</sup> pill?</p>\r\n\r\n<p>Often, we are googling, or reading in a magazine that taking certain supplements can be beneficial due to the lack of nutrients the average joe puts into his/her body. The information may also be tied to a good-looking model, almost thinking the youthful looks are just a few skips down the street to the grocery store towards the vitamin aisle.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&rsquo;s get to it.</p>\r\n\r\n<h3><strong>In every Multi-vitamin, or individual vitamin, you should have a general idea how they are each processed in your body. Knowing how vitamins are processed is a step in helping you make the right choice when taking </strong><strong>Vitamins.</strong></h3>\r\n\r\n<p>Taking vitamins, A, D, E, and K for example are the fat-soluble vitamins. These types of vitamins dissolve in fat and stored in body tissues. When these vitamins are stored in your fat over time over time they can accumulate to dangerous levels and it can essentially lead to a serious condition called Hypervitaminosis, which means excess amounts of a vitamins in the body, when more than the recommended amount is taken.</p>\r\n\r\n<p>Here are the dangers: Too much Vitamin A, D, or K can lead to increased levels that are unhealthy and can cause health consequences, for example too much vitamin A can lead to birth defects, and too high levels of Vitamin E may increase the risk of hemorrhaging. Excess Vitamin K can lessen, and even at times, reverse the effects of Blood thinner meds and prevent normal Blood clotting, just to name a few.</p>\r\n\r\n<p>The missing link most folks fail to realize due to lack of access to direct-to-consumer blood testing is the importance is knowing your vitamin blood test levels before consuming vitamins. Knowing your vitamin levels can prove a lack, or abundance to various vitamins and minerals. Taking more than the necessary fat-soluble vitamin can cause unnecessary harm you could&rsquo;ve easily avoided.</p>\r\n\r\n<h3><strong>Too Much Can Cause Harm</strong></h3>\r\n\r\n<p>When your blood vitamin levels go above and beyond the safe limits, directed by your doctor, vitamins can act as harmful as some drugs. Excessive calcium intake, according to experts, &nbsp;more than 2,500 mg a day, can interfere with kidney function, cause kidney stones and constipation, and interfere with the absorption of iron and zinc. One 2,500 mg calcium supplement is like drinking eight glasses of milk, which goes beyond the reasonable food level.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><strong>Fortified Foods Combined With Supplements</strong></h3>\r\n\r\n<p>Fortified foods can be just another way people can get additional nutrients. Fortified foods were the way many countries filled some nutrient complexities. Public health concerns years ago over nutrient deficiencies led the way to production practices like adding iodine to salt, grains enriched with B vitamins and iron, and milk fortified with vitamins A and D.</p>\r\n\r\n<p>But the combination of whole foods, supplements, and fortified foods raises safety concerns with experts. Eating fortified foods while also taking supplements can cause a person&#39;s diet to exceed safe upper levels and potentially lead to a toxic buildup.</p>\r\n\r\n<p>Did you know that simply consuming about six Brazil nuts, which weigh about 1 ounce, contain 544 micrograms of selenium&mdash;Yay selenium. That&#39;s a whopping 780% of the Daily Value of this trace mineral, which is only needed in small amounts.</p>\r\n\r\n<p><strong>Water Soluble</strong></p>\r\n\r\n<p>Because water-soluble vitamins and nutrients dissolve in water, the continuous supply your body needs calls for a steady daily intake, from the foods you eat, from the supplements you take, or from a combination of foods and supplements. Vitamins C, B12, thiamin, niacin, riboflavin, tryptophan, pantothenic acid, biotin, and folic acid are all classified in the water-soluble category.</p>\r\n\r\n<p>Water-soluble nutrients work best when you get them in the proper amounts. When you eat or take more than your body needs, the body adapts by absorbing just what it needs, and then it usually excretes the excess in your urine -- but not always. A study in the August 2010 <em>Journal of </em>nutrition <em>Science and Vitaminology</em> found that urinary excretion of certain vitamins and other nutrients was reduced when study participants fasted.</p>\r\n\r\n<p>The field of nutrition is ever-changing, and experts used to think that taking excess amounts of a water-soluble nutrient was harmless because the excesses would just be eliminated in urine. Today, we know that&rsquo;s not the case, and that some water-soluble vitamins and nutrients are handled differently by the body than others.</p>\r\n\r\n<p>Just because most water-soluble vitamins are not stored by the body, you can&rsquo;t assume that it is safe or effective to take more than the safe upper limit. In addition, you need to account for the vitamins and nutrients you get from the food you eat.</p>\r\n\r\n<p>For example, simply taking Vitamin B6 can cause nerve problems, too much Niacin can cause flushing, and excess Vitamin C can causeKidney Stones; in addition, excess folic acid may also mask a Vitamin B12 Deficiency , which is more common in people over age 50.</p>\r\n\r\n<p>Best ways to solve for X is by simply ordering your vitamin blood tests through NewCenturyLabs.com and get to know where your levels stand before putting your body at risk of danger.</p>\r\n\r\n<p><strong><a href=\"https://www.newcenturylabs.com/product/vitamin-d-25-hydroxy\">Know your Vitamin D levels for just $33.00!</a></strong></p>\r\n', 6, '1221504500142.jpg', 'Water soluble vs fat solubleand the dangers of vitamins ', 0, 0, 'Vitamins, supplements, blood test', 'Taking vitamins, A, D, E, and K for example are the fat-soluble vitamins. These types of vitamins dissolve in fat and stored in body tissues. When these vitamins are stored in your fat over time over time they can accumulate to dangerous levels and it can', 'Vitamin-supplements-dangers'),
(38, '2017-11-04 20:25:11', '2017-11-05 18:45:23', 1, 'blood test', 1, 'Top Ten Blood Tests ', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%;\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100.0%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p><strong>Ever wonder what the top 10 blood tests are for your health is?</strong></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%;\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100.0%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>New Century Labs receives countless emails from folks asking what they need to do to be more proactive and stay healthy.</p>\r\n\r\n						<p>Our first answer to this question is not diet, not exercise, its get to know the real &ldquo;you&rdquo; first from inside out. 70-80% of all clinical decisions are based off of 1 single drop of blood, and disease happens before you get a symptom. Our answer is get your blood tested first then you can come up with an action plan after you have spoken to your doctor.</p>\r\n\r\n						<p>New Century Labs has come up with what we call our top 10 blood tests that goes far beyond your annual wellness visit. Not to say your annual visit isn&rsquo;t significant, we know that these annual visits are constricted by your health insurance provider, they pick what they are willing to pay for, which excludes searching for important disease markers. Excluding disease markers can ultimately lead to death.</p>\r\n\r\n						<p>There are over 8,500 blood tests and out of this amount insurance providers won&rsquo;t pay for some of the most important ones. Lucky for you, New Century Labs has you covered with access and pricing from 80-90% off on demand, on your terms.</p>\r\n\r\n						<p>So you want to live longer, fight cancer, heart disease, diabetes, and have optimal hormone balance, and how about optimal sex hormones, zero mental depression, and various other abnormalities? It starts with just 1 drop of blood, so here we go.</p>\r\n\r\n						<p><br />\r\n						<br />\r\n						<strong><a href=\"https://newcenturylabs.com/product/comprehensive-metabolic-panel\" target=\"_blank\">1.&nbsp;</a><a href=\"https://newcenturylabs.com/product/comprehensive-metabolic-panel\" target=\"_blank\">Compressive Metabolic Panel (CMP) $14.00&nbsp;</a><br />\r\n						<br />\r\n						<a href=\"https://newcenturylabs.com/product/cbc-includes-differential-and-platelets\" target=\"_blank\">Complete Blood Count (CBC) $15.00&nbsp;</a></strong><br />\r\n						&nbsp;<br />\r\n						Both CBC and CMP panel are going to be your most basic tests, yet highly correlated to disease progression, and prevention&mdash;giving your physician a snap shot of your general wellness. For example the CBC blood test measures the quality of your overall blood health, looking at Red Blood Cells, White Blood Cells, Platelet count and other hematological abnormalities.<br />\r\n						The CMP Panel provides blood glucose, which is important for screening out diabetes risk. In addition you&rsquo;ll find an assessment of critical values such as calcium, potassium, and Iron, all of which checks for electrolyte balance.<br />\r\n						&nbsp;<br />\r\n						&nbsp;<br />\r\n						&nbsp;<a href=\"https://newcenturylabs.com/product/fibrinogen-activity\" target=\"_blank\"><strong>2. Fibrinogen $37.00</strong></a><br />\r\n						This is really important to blood clotting, for example increased fibrinogen levels can increase tissue inflammation. If you look at heart disease in general it starts with inflammation of the tissue, which can help predict the risk of heart disease and stroke. High levels of Fibrinogen are also associated with other inflammatory issues like Rheumatoid Arthritis and Glomerulonephritis (inflammation of the Kidney.)<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/hemoglobin-a1c\" target=\"_blank\"><strong>3. Hemoglobin A1C $23.00</strong></a><br />\r\n						Circling back to diabetes risk and checking glucose levels to assess potential diabetes, the Hemoglobin A1C test is an assessment of the average glucose levels for the last two to three months, also predicting heart disease and other metabolic syndromes.<br />\r\n						If you&nbsp;keep your A1C levels down, you decrease the risk of getting other disease. The amount of diabetes has significantly increased over the past decade where over 90M Americans are pre diabetic and don&rsquo;t even know it. This test &nbsp;will give you a definitive answer to the bigger picture. Patients who actively get their A1c and glucose levels checked are at better odds of combating risky blood sugar levels, as conscientious awareness can help design a healthy game plan and a healthier lifestyle.<br />\r\n						&nbsp;<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/dhea-dehydroepiandrosterone\" target=\"_blank\"><strong>4. DHEA $55.00</strong></a><br />\r\n						Dehydroepiandrosterone (DHEA) is a hormone produced by the adrenal glands is related to the sex hormones estrogen and testosterone. DHEA blood levels tent to peak in your 20&rsquo;s and decline from there with age, about 20-30%. Want to know what&rsquo;s also considered the anti-aging hormone? You guessed it, DHEA!&nbsp; If you have libido issues, and mood problems DHEA blood test is significantly important to do.<br />\r\n						However elevated DHEA may indicate adrenal hyperplasia, which is a group of various disorders that result from adrenal glands to produce glucocorticoids. Optimal DHEA levels can also help prevent diabetes, cancer, heart disease and depression.<br />\r\n						&nbsp;<br />\r\n						&nbsp;&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/psa-total\" target=\"_blank\"><strong>5. Prostate-Specific Antigen (PSA) (For Males Only) $26.00</strong></a><br />\r\n						&nbsp;<br />\r\n						Prostate-Specific Antigen (PSA) is a protein produced by the prostate gland in men. When you produce elevated levels, this could indicate various health concerns such as enlarged prostate, prostate inflammation, and Cancer. Studies suggest that eating a very healthy diet can significantly reduce and protect you from high PSA levels.<br />\r\n						&nbsp;<br />\r\n						&nbsp;&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/homocysteine\" target=\"_blank\"><strong>6. Homocysteine $30.00</strong></a><br />\r\n						&nbsp;<br />\r\n						&nbsp;<br />\r\n						Homocysteine is an Amino Acid created in the body. High Homocysteine levels have been associated with an increased risk to heart attacks, bone problems, and poor cognitive function.<br />\r\n						&nbsp;&nbsp;<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/crp\" target=\"_blank\"><strong>7. C-Reactive Protein $24.00</strong></a><br />\r\n						&nbsp;<br />\r\n						Higher than normal C-Reactive Protein has been discovered as high inflammation in the body which can lead to life-threatening diseases, such as coronary heart disease, diabetes, macular degeneration, and over- all cognitive decline. When you measure your bodies inflammation levels through this blood test you can actually reduce this inflammation by proper diet and exercise&mdash;knowing is half the battel. The high sensitive CRP (HS-CRP) can detect inflammation in arterial walls, giving a closer look as to heart disease. It is common to combining a Lipid panel with this test to add more conformation.<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/thyroid-stimulating-hormone-tsh\" target=\"_blank\"><strong>8. Thyroid Stimulating Hormone (TSH) $34.00</strong></a><br />\r\n						&nbsp;<br />\r\n						TSH is secreted by the Pituitary Gland. TSH controls thyroid hormone secretion in the thyroid. When your TSH levels go down this indicates hyperthyroidism activity, also known as thyrotoxicosis. When values are above normal this indicates low thyroid activity. Having optimal TSH levels can mean a better mood, more energy, and optimal weight.<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/testosterone-total-males-adult\" target=\"_blank\"><strong>9. Testosterone Male $30.00 Female $33.00</strong></a><br />\r\n						&nbsp;<br />\r\n						Testosterone is produced, drum roll, in the male testes and in the ovaries in women, also in the adrenal glands in both men and women. If you are male or female taking a testosterone blood test is clinically significant. Testosterone plays many roles in the body for men and women, libido, muscle mass, fertility n women, obesity, heart function, and mood. As men age naturally testosterone levels will decline, approximately 55-65% by age 75. In addition low testosterones levels have pointed to increased risk of heart attacks in men.<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://newcenturylabs.com/product/estradiol\" target=\"_blank\"><strong>10.&nbsp;</strong></a><strong><a href=\"https://newcenturylabs.com/product/estradiol\" target=\"_blank\">Estradiol&nbsp;</a></strong><a href=\"https://newcenturylabs.com/product/estradiol\"><strong>$31.00</strong></a><br />\r\n						&nbsp;<br />\r\n						Estradiol is primarily circulating from the estrogen in both men and women, is is an indicator of hypothalamic and pituitary function. Although men produce much smaller estradiol than women; in addition, most estradiol is produced from testosterone and adrenal steroid hormones, and a fraction is produced directly by the testes. In women, estradiol is produced in the ovaries, adrenal glands, and peripheral tissues. Levels of estradiol vary throughout the menstrual cycle, and drop to low but constant levels after menopause.<br />\r\n						In women, blood estradiol levels help to evaluate menopausal status and sexual maturity. Increased levels in women may indicate an increased risk for breast or endometrial cancer. Estradiol plays a role in supporting healthy bone density in men and women. Low levels are associated with an increased risk of osteoporosis and bone fracture in men and women as well. Elevated levels of estradiol in men may accompany gynecomastia (breast enlargement), diminished sex drive, and difficulty with urination.<br />\r\n						<strong>Women:</strong>&nbsp;Diminished levels of estradiol correlate with low levels of bone mineral density, which is a strong risk factor for osteoporosis.&nbsp;Optimizing estradiol levels in early menopausal women has been associated with relief from hot flashes, irritability, and insomnia.<br />\r\n						<strong>Men:</strong>&nbsp;In older men, low levels of estradiol have been linked with an increased risk of vertebral fractures, conversely, estradiol levels are found to be positively associated with bone mineral density, suggesting an association between low serum levels and the development of osteoporosis.&nbsp;<br />\r\n						Optimal estradiol levels may support healthy bone density, cardiovascular health, and well-being.</p>\r\n\r\n						<p><strong>In Summary</strong></p>\r\n\r\n						<p>You are ultimately in control of your health decisions, not your close circle, and not your Doctor. It is you who will decide which direction you want to take your health. In our modern era of abundant access and lower cost, we welcome you to take control of your health today and be a Proactive Warrior, fighting for a better you.<br />\r\n						Blood testing is seriously a powerful tool to unlock data about your current health condition, combating unwanted disease and ultimately sudden death.<br />\r\n						Many diseases are treatable if caught early and can help aid your doctor with a much more powerful clinical decision.</p>\r\n\r\n						<p><strong>Let&rsquo;s thrive!</strong></p>\r\n\r\n						<p>&nbsp;</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 6, '5101509907523.jpg', 'Ever wonder what the top 10 blood tests are for your health is?', 0, 0, 'Blood tests, lipid panel, Estradiol, Testosterone, TSH, C-Reactive Protein, Homocysteine, PSA, CBC, CMP, DHEA , A1C, Hemoglobin , Fibrinogen ', 'New Century Labs has come up with what we call our top 10 blood tests that goes far beyond your annual wellness visit. ', 'top-10-blood-tests'),
(39, '2017-11-20 04:46:02', '2017-11-20 04:46:02', 1, 'blood test, hs-crp, lipid ', 1, 'This Blood Test Can Save Your Life ', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnTextBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n						<h2 style=\"margin: 0px; padding: 0px; color: rgb(34, 34, 34); font-size: 28px; font-weight: bold; line-height: 42px;\">This Test Could Save Your Life</h2>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 27px; font-size: 18px !important;\">In 2016 the total US Population was 323M and 20% of this population died from a heart attack, that&rsquo;s 630,000 people, that&rsquo;s 1 in 4 people to put it into perspective, or every 40 seconds. Heart disease is the&nbsp;<strong>leading cause</strong>&nbsp;of death for people of most racial/ethnic groups in the United States, including African Americans, Hispanics, and whites costing the United States over 200 Billion Dollars per year. Heart disease however has various causes, our food, our lifestyle, for example how we handle stress, lack of exercise, and genetics just to name a few. &nbsp;<br />\r\n						&nbsp;</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnDividerBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnDividerBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnCaptionBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" width=\"false\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\" class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" valign=\"top\"><img alt=\"\" class=\"mcnImage\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/_compresseds/bd2717b5-98fd-4526-8d08-7337aaeb653f.jpg\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 3960px;\" width=\"564\" /></td>\r\n					</tr>\r\n					<tr>\r\n						<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n						<h3 style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-size: 22px; font-weight: bold; line-height: 33px;\">Common Heart Attack</h3>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">The most common type of heart disease is called Atherosclerosis, which is a form of plaque buildup from cholesterol and other substances inside the artery walls causing inflammation and decreased blood flow to the heart muscle. The symptoms are typically chest pain called Angina, to the point of heart failure ultimately causing death.<br />\r\n						Your body however could give you a warning sign long before you are categorized as a major risk factor by your doctor. Did you know however if you&rsquo;re a male one of the strongest indicators (no pun intended) is a weak erection. A special Health Report from Harvard Medical School, atherosclerosis in arteries supplying the penis can prevent the increase in blood flow needed to start or sustain an erection.<br />\r\n						In addition, blood vessel issues are the leading cause of erectile dysfunction. That&rsquo;s why Harvard&rsquo;s Dr. Michael P. O&rsquo;Leary,Harvods lead medical editor, says that erections &ldquo;serve as a indicator for your overall health,&rdquo; and that erectile dysfunction can be an early warning sign of trouble in the heart or elsewhere in the body. Many other early warnings signs of course are the same for both men and women, such as feeling tired, decreased memory, and shortness of breath are all symptoms.<br />\r\n						The common denominator with all heart disease patients is however inflammation. This starts just like getting a splinter, a scrape, or a bee sting. The pulsating swelling of damaging tissue is inflammation; inflammation can be hidden in your arteries at very low levels simply from cholesterol hitting your arterial wall, eventually causing a heart attack.<br />\r\n						&nbsp;</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnDividerBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnCaptionBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" width=\"false\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\" class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" valign=\"top\"><img alt=\"\" class=\"mcnImage\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/e8e84c9c-b576-4bdf-946b-d7b4b55f3ff8.jpg\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 493px;\" width=\"493\" /></td>\r\n					</tr>\r\n					<tr>\r\n						<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n						<h3 style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-size: 22px; font-weight: bold; line-height: 33px;\">Is there a silver bullet blood test?</h3>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">The answer is &ldquo;yes&rdquo; and New Century Labs has that cheap blood test you may have never heard about.<br />\r\n						HS-CRP (High Sensitivity C-Reactive Protein)<br />\r\n						High-sensitivity CRP is thought by some experts to be a useful test for determining risk of CVD,&nbsp;heart attacks, and&nbsp;strokes and that hs-CRP can play a role in the evaluation process BEFORE &nbsp;a person develops one of these health problems. Some say that the best way to predict risk is to combine a good marker for inflammation, like hs-CRP, with the lipid profile. Several groups have recommended that this test be used for people who have a moderate risk of heart attack over the next 10 years.<br />\r\n						Relatively high levels of hs-CRP in otherwise healthy individuals have been found to be predictive of an increased risk of a future&nbsp;heart attack,&nbsp;stroke, sudden cardiac death, and/or peripheral arterial disease, even when&nbsp;cholesterol levels&nbsp;are within an acceptable range.<br />\r\n						People with higher hs-CRP values have the highest risk of&nbsp;cardiovascular disease&nbsp;and those with lower values have less risk. Specifically, individuals who have hs-CRP results at the high end of the normal range have 1.5 to 4 times the risk of having a heart attack as those with hs-CRP values at the low end of the normal range.<br />\r\n						The American Heart Association and U.S. Centers for Disease Control and Prevention have defined risk groups as follows:</p>\r\n\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Low risk: less than 1.0 mg/L</li>\r\n							<li style=\"text-size-adjust: 100%;\">Average risk: 1.0 to 3.0 mg/L</li>\r\n							<li style=\"text-size-adjust: 100%;\">High risk: above 3.0 mg/L</li>\r\n						</ul>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">These values are only a part of the total evaluation process for cardiovascular diseases. Additional risk factors to be considered are elevated levels of cholesterol,&nbsp;LDL-C,&nbsp;triglycerides, and&nbsp;glucose. In addition, smoking, high blood pressure hypertension&nbsp;and&nbsp;diabetes&nbsp;also increase the risk level.</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnDividerBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnButtonBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnButtonBlockOuter\">\r\n		<tr>\r\n			<td align=\"center\" class=\"mcnButtonBlockInner\" style=\"text-size-adjust: 100%; padding: 0px 18px 18px;\" valign=\"top\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnButtonContentContainer\" style=\"text-size-adjust: 100%; border-radius: 3px; background-color: rgb(0, 173, 216);\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\" class=\"mcnButtonContent\" style=\"text-size-adjust: 100%; font-family: Helvetica; font-size: 18px; padding: 18px;\" valign=\"middle\"><a class=\"mcnButton \" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=471cbe7091&amp;e=b2ecb58087\" style=\"text-size-adjust: 100%; display: block; font-weight: bold; letter-spacing: -0.5px; line-height: 18px; text-decoration-line: none; color: rgb(255, 255, 255);\" target=\"_blank\" title=\"HS-CRP Blood Test \">HS-CRP Blood Test</a></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnCaptionBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" width=\"false\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\" class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" valign=\"top\"><img alt=\"\" class=\"mcnImage\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/fc7ae845-3479-4ce4-9df4-259d9035af4e.jpg\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 849px;\" width=\"564\" /></td>\r\n					</tr>\r\n					<tr>\r\n						<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n						<h3 style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-size: 22px; font-weight: bold; line-height: 33px;\">Just a Click Away</h3>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">HS-CRP test can be easily ordered at New Century Labs, results are typically 48 hours and it can be a true life saver for a more awareness and control of your own health, creating a more proactive healthy lifestyle.<br />\r\n						&nbsp;</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnDividerBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnBoxedTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n	<tbody class=\"mcnBoxedTextBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnBoxedTextBlockInner\" style=\"text-size-adjust: 100%;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnBoxedTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%; padding: 9px 18px;\">\r\n						<table border=\"0\" cellspacing=\"0\" class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; background-color: rgb(247, 247, 247); min-width: 100%;\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; text-align: center; padding: 18px;\" valign=\"top\">\r\n									<h3 style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-size: 22px; font-weight: bold; line-height: 33px;\">We Look Forward to Serving You!</h3>\r\n\r\n									<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">24 Hours a day 7 Days Per Week</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 9, '9341511153162.jpg', 'HS-CRP blood test is thought by some experts to be a useful test for determining risk of CVD', 0, 0, 'Cheap Blood Test, HS CRP, Direct-to-consumer, Lipid test', 'High-sensitivity CRP is thought by some experts to be a useful test for determining risk of CVD, heart attacks, and strokes and that hs-CRP can play a role in the evaluation process BEFORE  a person develops one of these health problems. Some say that the', 'hs-crp-blood-test'),
(42, '2017-12-19 06:47:54', '2017-12-19 07:22:44', 1, 'Omega 3, 6 Fatty Acids, Cheap blood test, online blood test, cardio, lipid , Brain function', 1, 'Omega-3 and -6 Fatty Acids', '<h1>Omega 3 and 6 Fatty Acids can actually be the key to optimizing your health&nbsp;</h1>\r\n\r\n<p>Our bodies are capable of producing all the fatty acids it needs; however, except for the two we will mention: linoleic acid (LA), an&nbsp;omega-6&nbsp;fatty acid, in addition to alpha-linolenic acid (ALA), an&nbsp;omega-3 fatty acid. Both of these have to be consumed from the diet and they are called &ldquo;essential fatty acids.&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Both the omega-6 and omega-3 fatty acids belong to a large subclass of polyunsaturated fats this is where the word &#39;essential&#39; comes in because they are required for optimal health yet we cannot produce them in the body, as they must be obtained from diet. Their differences lie in their chemical structure and their roles in the body.</p>\r\n\r\n<p>As polyunsaturated fatty acids, both the omega-6 and the omega-3 families have more than one double bond in the carbon chain. All fatty acids in the omega-6 family contain their first double bond between the 6th and 7th carbon atoms (counted from the methyl (CH3) terminal carbon atom and the omega-3 family of fatty acids have their first double bond between the 3rd and 4th carbon atom.</p>\r\n\r\n<p>Both families of fatty acids are vital components of membranes and are used by the body in the production of eicosanoids, a vast range of highly bioactive substances (prostaglandins, leukotrienes, and lipoxins) but the activity of these metabolites varies. For example, the eicosanoids derived from omega-6 are in general more active (or reactive) than those produced from omega-3 and omega-6 is aggregatory whereas oega-6 is pro-aggregatory.</p>\r\n\r\n<p>In otherwords, the omega-3s have anti-inflammatory benefits and help prevent heart disease, whereas omega-6s lower blood cholesterol and support the skin.</p>\r\n\r\n<p>Like all fats, EFAs provide energy. Their calorific value is similar to other fats and oils but, unlike saturated fats, they have important health roles. In fact, as their name suggest, they are essential and must be consumed regularly as the body has limited storage for them.</p>\r\n\r\n<p>Both of the important EFA families - omega-6 and omega-3 - are components of nerve cells and cellular membranes. They are converted by the body into eicosanoids, leukotrienes and prostaglandins - all of which are needed on a second-by-second basis by most tissue activities in the body.</p>\r\n\r\n<div>\r\n<p><strong>Omega-3 and 6 Fatty Acids do have their purpose</strong></p>\r\n</div>\r\n\r\n<ul>\r\n	<li>Regulating pressure in the eye, joints, and blood vessels, and mediating immune response</li>\r\n	<li>Regulating bodily secretions and their viscosity</li>\r\n	<li>Dilating or constricting blood vessels</li>\r\n	<li>Regulating collateral circulation</li>\r\n	<li>Directing endocrine hormones to their target cells</li>\r\n	<li>Regulating smooth muscles and autonomic reflexes</li>\r\n	<li>Being primary constituents of cell membranes</li>\r\n	<li>Regulating the rate of cell division</li>\r\n	<li>Maintaining the fluidity and rigidity of cellular membranes</li>\r\n	<li>Regulating the inflow and outflow of substances to and from cells</li>\r\n	<li>Transporting oxygen from red blood cells to the tissues</li>\r\n	<li>Maintaining proper kidney function and fluid balance</li>\r\n	<li>Keeping saturated fats mobile in the blood stream</li>\r\n	<li>Preventing blood cells from clumping together (blood clots that can be a cause of heart attack and stroke)</li>\r\n	<li>Mediating the release of inflammatory substances from cells that may trigger allergic conditions</li>\r\n	<li>Regulating nerve transmission and communication</li>\r\n	<li>If the diet is deficient in either omega-6 or omega-3 long-term degenerative illnesses will result.</li>\r\n</ul>\r\n\r\n<p><img alt=\"Image result for fish omega\" src=\"https://i.ndtvimg.com/i/2016-09/fish-oil-625_625x350_71474879317.jpg\" /></p>\r\n\r\n<p><strong>Where to get Omega 3 fats:</strong></p>\r\n\r\n<p>Cold water fish, tuna, cod liver, halibut, herring, mackerel, trout, salmon, sardines.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Where to get Omega 6 fats:</strong></p>\r\n\r\n<p>Sunflower seeds, seed oils, corn, pumpkin seeds, sesame seeds, nuts, meat, dairy products.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Before running to the vitamin store we encourage you to test for Omega-3 and 6 fatty acids by doing a simple blood test. Once you know if you&rsquo;re deficient you can discuss the next steps with your doctor regarding supplementation if needed.</p>\r\n', 6, '3041513666074.jpg', 'he omega-3s have anti-inflammatory benefits and help prevent heart disease, whereas omega-6s lower blood cholesterol and support the skin.', 0, 0, 'omega 3, omega 6, cheap blood test, order blood tests online, health, direct-to-consumer, cardio iq ', 'Omega 3 and 6 Fatty Acids can actually be the key to optimizing your health reducing the risk of heart disease, cancers, and optimal brain function, and yes, we do have that blood test.', 'Omega-3-and-6-Fatty-Acids');
