(43, '2018-03-07 09:15:37', '2018-03-07 09:17:09', 1, 'Blood Test, Hormone, Thyroid, blood, test, Results, Quest Diagnostics', 1, 'Are Your Hormones Telling You How To Live Your Life ', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnTextBlock\" font-size:=\"\" min-width:=\"\" new=\"\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: rgb(0, 0, 0); font-family: \" times=\"\" width=\"100%\">\r\n	<tbody class=\"mcnTextBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n						<h1 style=\"margin: 0px; padding: 0px; color: rgb(34, 34, 34); font-size: 40px; font-weight: bold; line-height: 60px; text-align: center;\"><img src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/48831d04-d11c-4aca-83d3-48506895e1ad.jpg\" /></h1>\r\n\r\n						<h1 style=\"margin: 0px; padding: 0px; color: rgb(34, 34, 34); font-size: 40px; font-weight: bold; line-height: 60px; text-align: center;\"><span style=\"font-size: 24px;\">Your Hormones actually can</span></h1>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerBlock\" fixed=\"\" font-size:=\"\" min-width:=\"\" new=\"\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: rgb(0, 0, 0); font-family: \" table-layout:=\"\" times=\"\" width=\"100%\">\r\n	<tbody class=\"mcnDividerBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnImageBlock\" font-size:=\"\" min-width:=\"\" new=\"\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: rgb(0, 0, 0); font-family: \" times=\"\" width=\"100%\">\r\n	<tbody class=\"mcnImageBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnImageBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnImageContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td class=\"mcnImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px; text-align: center;\" valign=\"top\"><img align=\"center\" alt=\"\" class=\"mcnImage\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/e503d9e6-3132-470d-baef-cb28c8bc9729.jpg\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 704px; padding-bottom: 0px; display: inline !important;\" width=\"564\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnTextBlock\" font-size:=\"\" min-width:=\"\" new=\"\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: rgb(0, 0, 0); font-family: \" times=\"\" width=\"100%\">\r\n	<tbody class=\"mcnTextBlockOuter\">\r\n		<tr>\r\n			<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n			<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: rgb(128, 128, 128); font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><strong>Your hormones can actually control your every function</strong><br />\r\n						The&nbsp;endocrine system is a network of glands that produce and release hormones that help control many important body functions, including the body&#39;s ability to change calories into energy that powers cells and organs. &nbsp;The endocrine system influences how your heart&nbsp;beats how your bones and tissues grow, even your ability to make a baby. It plays a vital role in whether or not you develop diabetes thyroid&nbsp;disease, growth disorders, sexual dysfunction, and a host of other hormone-related disorders. In other words, your hormones control your life for better or worse!<br />\r\n						<br />\r\n						Major glands that make up the human endocrine system include:<br />\r\n						&nbsp;<br />\r\n						<strong>-Hypothalamus<br />\r\n						-Pituitary gland<br />\r\n						-Thyroid<br />\r\n						-Parathyroid<br />\r\n						-Pancreas<br />\r\n						-Adrenal Glands<br />\r\n						-Pineal body<br />\r\n						-Reproductive glands (Ovaries and Testes) | Pancreas.</strong><br />\r\n						&nbsp;<br />\r\n						There are several hormones working in our body controlling almost every body function, ranging from the rate of chemical reactions, transporting substances through membranes, electrolyte balance, water balance, blood pressure, etc. Hormones are responsible for managing development, reproduction, growth, and behavior&mdash; and a change in hormones can even change our personalities.<br />\r\n						Being hormonally imbalanced can cause weight gain, weight loss, depression, poor libido. Stopping at just that would give hormone imbalance little to worry about, but there&#39;s more. How about migraines, acne, menopause, heart problems, and increasing cancer risk. According to the National Cancer institute For instance, &ldquo;taking combined menopausal hormone therapy (estrogen plus progestin, which is a synthetic version of the female hormone progesterone) can increase a woman&rsquo;s risk of breast cancer.&nbsp;&ldquo; In addition to a slew of other cancers.<br />\r\n						<br />\r\n						Hormones have a lot of authority. They are the little chemicals that tell your body just right down to the cell what to do and how to do it.<br />\r\n						And the reality is, there are many other hormones in our body, if not balanced, that can have an influence on your risk of various diseases throughout the body.<br />\r\n						This is why its important to take action when you have any of the following symptoms below to get your blood tested:<br />\r\n						<br />\r\n						Tired, weight loss/gain, depression, anxiety, heart arrhythmia, poor libido, insomnia just to name a few.<br />\r\n						Did you know that imbalanced hormones can spike your cholesterol levels putting you at risk of a heart attack.&nbsp;<br />\r\n						&nbsp;<br />\r\n						<strong>Looking in the mirror won&rsquo;t tell you what&rsquo;s going on inside</strong><br />\r\n						Maintaining the health of your hormones should be of utmost importance to you. As you&rsquo;ve read, hormones control almost everything in our body; therefore, it is important to get to know if your hormones are optimal.<br />\r\n						Most hormones can be detected in blood tests and even salivary tests and hormonal imbalance has capabilities of destroying your health if kept under the radar and being that 70-80% of all clinical decisions come from blood testing and disease produces first without symptoms, signs, or warnings, optimizing hormone balance will need to be done with an appropriate medical professional. After reviewing your blood tests your recommendation may just begin with a change in diet and environmental changes, medication and supplementation.<br />\r\n						Relying on symptoms is not the best approach, as catching red flags can be caught early before disease is welcomed in the body. As you can see, optimal hormone balance is very important to achieving top health and a proper functioning of our body.<br />\r\n						&nbsp;<br />\r\n						Access to hormone balance blood tests can be done on the fly and we have them listed for easy checkout.<br />\r\n						If you&rsquo;re concerned about hormone imbalance check out our list of blood tests below:<br />\r\n						<br />\r\n						<a href=\"https://www.newcenturylabs.com/product/thyroid-stimulating-hormone-tsh\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>TSH</strong></a><br />\r\n						To screen for and help diagnose&nbsp;thyroid disorders; to monitor treatment of&nbsp;hypothyroidism&nbsp;and&nbsp;hyperthyroidism<br />\r\n						Ordered when you have the following concerns:</p>\r\n\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping,</li>\r\n							<li style=\"text-size-adjust: 100%;\">Tremors in the hands ,Weakness, Diarrhea (sometimes),</li>\r\n							<li style=\"text-size-adjust: 100%;\">Light sensitivity, visual disturbances, The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes</li>\r\n						</ul>\r\n\r\n						<div>Signs and symptoms of hypothyroidism may include: Weight gain, Dry skin, Constipation, Cold intolerance, Puffy skin, Hair loss, Fatigue, Menstrual irregularity in women.</div>\r\n						<br />\r\n						<a href=\"https://www.newcenturylabs.com/product/t3-free\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>T3 Free</strong></a><br />\r\n						<a href=\"https://www.newcenturylabs.com/product/t3-total\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>T 3 Total</strong></a><br />\r\n						<br />\r\n						A free T3 or total T3 test may be ordered when someone has an abnormal&nbsp;TSH test result. It may be ordered as part of the investigative workup when a person has symptoms suggesting&nbsp;hyperthyroidism, especially if the&nbsp;free T4 level&nbsp;is not elevated.<br />\r\n						Ordered when you have the following concerns:<br />\r\n						Signs&nbsp;and&nbsp;symptoms&nbsp;may include:\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping, Tremors in the hands, weakness, Diarrhea (sometimes), Light sensitivity, visual disturbances</li>\r\n							<li style=\"text-size-adjust: 100%;\">The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes. Free or total T3 may sometimes be ordered at intervals to monitor a known&nbsp;thyroid condition&nbsp;and to help monitor the effectiveness of treatment for hyperthyroidism.</li>\r\n						</ul>\r\n\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping,</li>\r\n							<li style=\"text-size-adjust: 100%;\">Tremors in the hands, Weakness, Diarrhea (sometimes)</li>\r\n							<li style=\"text-size-adjust: 100%;\">Light sensitivity, visual disturbances,</li>\r\n							<li style=\"text-size-adjust: 100%;\">The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes.</li>\r\n						</ul>\r\n						Free or total T3 may sometimes be ordered at intervals to monitor a known&nbsp;thyroid condition&nbsp;and to help monitor the effectiveness of treatment for hyperthyroidism.<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://www.newcenturylabs.com/product/t4-free\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>T4 Free</strong></a><br />\r\n						Thyroxine (T4) is one of two major&nbsp;hormones&nbsp;produced by the thyroid gland, a small butterfly-shaped organ that lies flat across the windpipe at the base of the throat. The other major thyroid hormone is called&nbsp;triiodothyronine (T3)&nbsp;and together they help control the rate at which the body uses energy. Almost all of the T4 (and T3) found in the blood is bound to protein. The rest is free (unbound) and is the biologically active form of the hormone. This test measures the amount of free T4 in the blood.<br />\r\n						&nbsp;<br />\r\n						Ordered when you have the following concerns:<br />\r\n						Signs&nbsp;and&nbsp;symptoms&nbsp;may include:\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping, Tremors in the hands, Weakness, Diarrhea (sometimes), Light sensitivity, visual disturbances</li>\r\n							<li style=\"text-size-adjust: 100%;\">The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes.</li>\r\n						</ul>\r\n						Symptoms of hypothyroidism may include:\r\n\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Weight gain, Dry skin, Constipation, Cold intolerance, Puffy skin, Hair loss</li>\r\n							<li style=\"text-size-adjust: 100%;\">Fatigue, Menstrual irregularity in women, Enlarged thyroid gland (goiter)</li>\r\n						</ul>\r\n						Free T4 testing may be ordered along with other thyroid tests on a regular basis when a person is undergoing treatment for a&nbsp;thyroid disorder.<br />\r\n						&nbsp;<br />\r\n						<span style=\"color: rgb(255, 0, 0);\"><a href=\"https://www.newcenturylabs.com/product/testosterone-total-males-adult\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>Testosterone Male</strong></a><br />\r\n						<a href=\"https://www.newcenturylabs.com/product/testosterone-total-females\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>Testosterone Female</strong></a><br />\r\n						&nbsp;</span><br />\r\n						Testosterone is the main sex hormone (androgen) in men. It is responsible for male physical characteristics. Although it is considered to be a &quot;male&quot; sex hormone, it is present in the blood of both men and women. This test measures the level of testosterone in the blood.<br />\r\n						Testosterone is mainly produced by special&nbsp;endocrine&nbsp;tissue (the Leydig cells) in the male testicles. It is also produced by the&nbsp;adrenal glands in both males and females and, in small amounts, by the ovaries in females.<br />\r\n						In males, testosterone stimulates development of secondary sex characteristics, including enlargement of the penis, growth of body hair, muscle development, and a deepening voice. It is present in large amounts in males during puberty and in adult males to regulate the sex drive and maintain muscle mass. In women, testosterone is converted to estradiol, the main sex hormone in females.<br />\r\n						Ordered when decreased sex drive or&nbsp;erectile dysfunction. Some other symptoms include lack of beard and body hair, decreased muscle mass, and development of breast tissue (gynecomastia). Low levels of total and bioavailable testosterone have also been associated with, or caused by, a greater presence of visceral fat (midriff or organ fat),&nbsp;insulin resistance, and increased risk of&nbsp;coronary artery disease.<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://www.newcenturylabs.com/product/DHEA-Sulfate-Blood-Test\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>DHEAS</strong></a><br />\r\n						<br />\r\n						Dehydroepiandrosterone sulfate (DHEAS) is a male sex hormone (androgen) that is present in both men and women. This test measures the level of DHEAS in the blood.<br />\r\n						DHEAS:\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">Plays a role in developing male secondary sexual characteristics at puberty</li>\r\n							<li style=\"text-size-adjust: 100%;\">Can be converted by the body into more potent androgens, such as&nbsp;testosterone&nbsp;and&nbsp;androstenedione</li>\r\n							<li style=\"text-size-adjust: 100%;\">Can be converted into the female hormone&nbsp;estrogen<br />\r\n							&nbsp;</li>\r\n						</ul>\r\n						DHEAS is produced almost exclusively by the&nbsp;adrenal glands, with smaller amounts being produced by a woman&#39;s ovaries and a man&#39;s testicles.<br />\r\n						It is useful as a marker for adrenal gland function. Adrenal tumors (cancerous and non-cancerous) and adrenal&nbsp;hyperplasia&nbsp;can lead to the overproduction of DHEAS. Rarely, an ovarian tumor may produce DHEAS.<br />\r\n						Excess DHEAS:\r\n						<ul>\r\n							<li style=\"text-size-adjust: 100%;\">May not be noticed in adult men</li>\r\n							<li style=\"text-size-adjust: 100%;\">Can cause early (precocious) puberty in young boys</li>\r\n							<li style=\"text-size-adjust: 100%;\">Can lead to absence of menstrual periods (amenorrhea) and the development of masculine physical characteristics (virilization) in girls and women, such as excess body and facial hair (hirsutism)</li>\r\n							<li style=\"text-size-adjust: 100%;\">Can cause a female baby to be born with genitals that are not distinctly male or female in appearance (ambiguous external genitalia)<br />\r\n							&nbsp;</li>\r\n						</ul>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">This test is ordered when<br />\r\n						A DHEAS test may be ordered, along with other hormone tests, whenever excess (or, more rarely, deficient)&nbsp;androgen&nbsp;production is suspected and/or when a health practitioner wants to evaluate a person&#39;s&nbsp;adrenal gland&nbsp;function.<br />\r\n						&nbsp;<br />\r\n						<a href=\"https://www.newcenturylabs.com/product/cortisol-am\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>Cortisol AM</strong></a><br />\r\n						<a href=\"https://www.newcenturylabs.com/product/cortisol-pm\" style=\"text-size-adjust: 100%; color: rgb(0, 173, 216);\" target=\"_blank\"><strong>Cortisol PM&nbsp;</strong></a><br />\r\n						<br />\r\n						Cortisol is a&nbsp;hormone&nbsp;that plays a role in the&nbsp;metabolism&nbsp;of&nbsp;proteins,&nbsp;lipids, and&nbsp;carbohydrates. It affects&nbsp;blood glucose levels, helps maintain blood pressure, and helps regulate the&nbsp;immune system. Most cortisol in the blood is bound to a protein; only a small percentage is &quot;free&quot; and biologically active. Free cortisol is secreted into the urine and is present in the saliva. This test measures the amount of cortisol in the blood, urine, or saliva.<br />\r\n						The level of cortisol in the blood (as well as the urine and saliva) normally rises and falls in a &quot;diurnal variation&quot; pattern. It peaks early in the morning, then declines throughout the day, reaching its lowest level about midnight. This pattern can change when a person works irregular shifts (such as the night shift) and sleeps at different times of the day, and it can become disrupted when a disease or condition either limits or stimulates cortisol production.<br />\r\n						&nbsp;</p>\r\n\r\n						<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">Don&#39;t Just Think You&#39;re Healthy, Know You&#39;re Healthy&nbsp;</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 6, '7731520414137.jpg', 'Blood Testing to check your hormones on the fly', 0, 0, 'Blood tests, lipid panel, Estradiol, Testosterone, TSH, C-Reactive Protein, Homocysteine, PSA, CBC, CMP, DHEA , A1C, Hemoglobin , Fibrinogen, hormone balance, thyroid', 'Hormones have a lot of authority. They are the little chemicals that tell your body just right down to the cell what to do and how to do it. And the reality is, there are many other hormones in our body, if not balanced, that can have an influence on your', 'hormone-balance-blood-tests');
