INSERT INTO `content` VALUES
(1, 'page', 'paypal_success', 'Your Payment was successful', 'sad', 'dsa', '<p>Thank you for your payment!</p>\r\n\r\n<p>Your lab order is currently in process and can take up to 4 hours to complete. Your transaction has been completed, and a receipt for your purchase has been emailed to you. You will receive your lab order via secure link to the email you provided. Please print your lab order and take it with you to one of our Patient Service Centers, powered by Quest Diagnostics.</p>\r\n\r\n<p>We look forward to serving you!</p>\r\n\r\n<p>Tel:1-800-519-2997</p>\r\n\r\n<p><a href=\"mailto:Customerservice@newcenturylabs.com\">Customerservice@newcenturylabs.com</a></p>\r\n\r\n<p>Thanks again and have a proactive day.</p>\r\n', 'en_uk', 'asd', '', '', '2016-02-24 12:14:19', '2017-03-04 08:15:58', 1, 0, '6451456317215.jpg', 'paypal-success'),
(2, 'page', 'paypal_cancel', 'Failure ', '', '', 'Please Try Again', '', '', '', '', NULL, '2016-10-06 12:14:55', 1, 0, NULL, 'paypal-cancel'),
(3, 'email', 'order_confirmation', 'Your Order is being processed.', 'Your Order is being processed.', NULL, '<p>Dear %%NAME%%</p>\r\n\r\n<p>Your order number is &quot;%%ID%%&quot;.</p>\r\n\r\n<p>Thank you for online purchase. The confirmation and summary of you order is current being processed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>newcenturylabs</p>\r\n', '', NULL, NULL, NULL, NULL, '2017-04-10 04:08:28', 1, 0, NULL, NULL),
(7, 'email', 'forgot_password', 'Your new newcenturylabs.com password', 'Your new newcenturylabs.com password', NULL, '<p>Dear %%NAME%%</p>\r\n\r\n<p>If you&#39;ve forgotten your password no worries, simply copy and paste your temporary password to this link below then create your unique password under &quot;My Account.&quot;</p>\r\n\r\n<p>New passowrd: %%PASSWORD%%</p>\r\n\r\n<p>For your convenience, you can change you password by visiting the &quot;My Account&quot; section of our website.</p>\r\n\r\n<p>Please email or call customer service if you have any questions.</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>newcenturylabs</p>\r\n\r\n<p><strong><u>HIPAA Notice</u></strong></p>\r\n\r\n<p>The contents of this message, together with any attachments, are intended only for the use of the person(s) to which they are addressed and may contain confidential and/or privileged information. Further, any medical information herein is confidential and protected by law. It is unlawful for unauthorized persons to use, review, copy, disclose, or disseminate confidential medical information. If you are not the intended recipient, immediately advise the sender and delete this message and any attachments. Any distribution, or copying of this message, or any attachment, is prohibited.</p>\r\n', '', NULL, NULL, NULL, '2016-04-15 15:06:04', '2017-02-10 16:34:27', 1, 0, NULL, NULL),
(9, 'email', 'order_status', 'You newcenturylabs.local Order Status', NULL, NULL, '<p>Dear %%NAME%%</p>\r\n<p>Thank you for online purchase. Your order %%ID%%  is currently %%STATUS%%.</p>\r\n<p>For your convenience, you will able to track the status of you online orders by visiting the \" %%ACCOUNT%% \" section of our website.</p>\r\n<p>Regards,</p>\r\n<p>newcenturylabs</p>', '', NULL, NULL, NULL, NULL, NULL, 1, 0, NULL, NULL),
(10, 'page', 'check_success', 'Check Success Message', 'Check Success Message', '', '<p>&nbsp;</p>\r\n\r\n<p>Thank you for your Order!</p>\r\n\r\n<p>Your lab order will be emailed to you within a 4 hour window of your order, during our hours of operation 8AM PST to 10PM PST. Please note if you have scheduled for a MD consult, your results must be complete before communication. We look forward to serving you!</p>\r\n\r\n<p>Tel.: +1-800-519-2997</p>\r\n\r\n<p>customerservice@newcenturylabs.com</p>\r\n\r\n<p>Thanks again and have a proactive day.</p>\r\n', '', '', '', '', '2016-11-23 12:04:57', '2017-02-13 15:38:20', 1, 0, NULL, 'check-success-message'),
