(12, 'page', 'aboutus', 'About Us', NULL, '', '<section class=\"page-bnr-area bg-full bg-cntr valigner\" style=\"background-image:url(\'{{asset(\'\')}}front/images/bnr-about.jpg\');\">\r\n<div class=\"container\">\r\n<div class=\"bnr__cont valign white text-center col-sm-12 text-uppercase anime-flipInX\">\r\n<h2>About us</h2>\r\n\r\n<h3>The very center of healthcare starts at the core<br />\r\nfundamentals of diagnostic testing.</h3>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"about-area pt50 pb50\">\r\n<div class=\"container\">\r\n<div class=\"cont\">\r\n<p>When information about your body matters most to you, our goal is to help you access it so you can make informed decisions about your health. Our main goal is to help empower individuals with easy access to ordering medical laboratory tests custom tailored to each and everybody&rsquo;s individual needs. Our mission is to help individuals take better control of their healthcare, ultimately to prevent and treat potential diseases early.</p>\r\n\r\n<p>We believe health and wellness starts by getting to know the real &ldquo;you&rdquo; from inside out.</p>\r\n</div>\r\n\r\n<div class=\"clearfix\">&nbsp;</div>\r\n\r\n<div class=\"about-box col-sm-4 anime-left\">\r\n<div class=\"about__icon\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/about-icon1.png\" /></div>\r\n\r\n<div class=\"about__cont\">\r\n<h3>World class service from start to finish</h3>\r\n\r\n<p>We treat everybody here like a member, but without any membership fees. We strive to be the lowest cost providers online with the highest quality service and fast result times.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"about-box col-sm-4 anime-in\">\r\n<div class=\"about__icon\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/about-icon2.png\" /></div>\r\n\r\n<div class=\"about__cont\">\r\n<h3>Security and privacy</h3>\r\n\r\n<p>Your information from ordering tests to receiving results are kept confidential and secure. We follow extremely strict HIPAA guidelines and your information will never be sold or made public.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"about-box col-sm-4 anime-right\">\r\n<div class=\"about__icon\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/about-icon3.png\" /></div>\r\n\r\n<div class=\"about__cont\">\r\n<h3>Locations</h3>\r\n\r\n<p>We have over 2,300 patient service centers throughout the United States for you to take your lab orders to. Feel free to just show up with your lab order, no appointment necessary.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"testlab-area text-center bg-full white p100 valigner\" style=\"background-image:url(\'{{asset(\'\')}}front/images/about-bot.jpg\');\">\r\n<div class=\"container\">\r\n<div class=\"valign \">\r\n<h4>New Century Labs is powered by Quest Diagnostics, the<br />\r\nworld&rsquo;s most credible and advanced Lab.</h4>\r\n\r\n<div class=\"inline-btns mt40\">\r\n<div class=\"lnk-btn inline-block def-btn hover\"><a href=\"{{url(\'\')}}/shop\">View Tests</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n', '', 'About Us', '', '', NULL, '2017-04-24 16:33:34', 1, 0, NULL, 'aboutus'),
(13, 'page', 'how_to_order', 'How To Order', NULL, '', '<section class=\"page-bnr-area bg-full valigner\" style=\"background-image:url(\'{{asset(\'\')}}front/images/bnr-how.jpg\');\">\r\n<div class=\"container\">\r\n<div class=\"bnr__cont valign white text-center col-sm-12 anime-flipInX\">\r\n<h2>DON&rsquo;T JUST THINK YOU&rsquo;RE HEALTHY, <span>KNOW YOU&rsquo;RE HEALTHY</span></h2>\r\n\r\n<p>Ordering tests when you need to know made easy</p>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"how-step-area pt50 pb50\">\r\n<div class=\"container\">\r\n<div class=\"step__cont col-sm-5\">\r\n<div class=\"step__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/how1.png\" /></div>\r\n</div>\r\n\r\n<div class=\"step__cont col-sm-7 valigner anime-left\">\r\n<div class=\"step_list clrlist listview valign\">\r\n<h3>STEP 1</h3>\r\n\r\n<ul>\r\n	<li>Find your lab test(s) of choice.</li>\r\n	<li>Check out with your credit card.</li>\r\n	<li>Your lab order will be located in your email securely and confidentially.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"clearfix\">&nbsp;</div>\r\n\r\n<div class=\"step__cont col-sm-7 valigner anime-left\">\r\n<div class=\"step_list clrlist listview valign\">\r\n<h3>STEP 2</h3>\r\n\r\n<ul>\r\n	<li>Print your lab order and take it with you to one of our 2,300 Patient Service Center locations. Walk-ins are always welcome!</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"step__cont col-sm-5\">\r\n<div class=\"step__img\"><img alt=\"\" src=\"{{asset(\'\')}}/front/images/how3.png\" /></div>\r\n</div>\r\n\r\n<div class=\"clearfix\">&nbsp;</div>\r\n\r\n<div class=\"step__cont col-sm-5\">\r\n<div class=\"step__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/how2.png\" /></div>\r\n</div>\r\n\r\n<div class=\"step__cont col-sm-7 valigner anime-left\">\r\n<div class=\"step_list clrlist listview valign\">\r\n<h3>STEP 3</h3>\r\n\r\n<ul>\r\n	<li>Test results on average take 72 hours and will be emailed to you as soon as results are complete. You may print your lab results and take it with you to discuss with your doctor if needed.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"clearfix\">&nbsp;</div>\r\n\r\n<div class=\"step__cont col-sm-7 valigner anime-left\">\r\n<div class=\"step_list clrlist listview valign\">\r\n<h3>Convenient Ordering</h3>\r\n\r\n<ul>\r\n	<li>Order labs and view results from your desk top or any mobile device.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"step__cont col-sm-5\">\r\n<div class=\"step__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/how4.png\" /></div>\r\n</div>\r\n</div>\r\n</section>\r\n', '', '', '', '', NULL, '2017-01-31 13:26:10', 1, 0, NULL, 'how_to_order'),
(14, 'page', 'faq', 'Faq', NULL, '', '<section class=\"inr-intro-area pt100 pb40\">\r\n<div class=\"container\">\r\n<div class=\"hed text-center\">\r\n<h2>FAQ</h2>\r\n</div>\r\n\r\n<div calss=\"cont\">\r\n<h3>Still have questions?</h3>\r\n\r\n<p>Here are some of the commonly asked questions people have about lab testing</p>\r\n\r\n<div class=\"panel-group accordion-arr\" id=\"accordion\">\r\n<div class=\"col-sm-6 p0\">\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapseOne\">Can I take my lab test results to my doctor? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse \" id=\"collapseOne\">\r\n<div class=\"panel-body\">Absolutely! We encourage you to take your lab test results to your doctor if you need to.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapseTwo\">When do I get my results? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapseTwo\">\r\n<div class=\"panel-body\">It depends on the test most tests take 24-72 hours to complete, however some test may take longer, please click on the test you are interested in to find out more information on timing.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapseThree\">Can I order a lab test not offered on your website? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapseThree\">\r\n<div class=\"panel-body\">Yes, all you have to do is email customer service with the test code(s) and name of the test(s) we will make sure you get it.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse4\">Do I need to fast before I go to the draw center? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse4\">\r\n<div class=\"panel-body\">It depends on the test, some tests do not require fasting, please read the description under patient prep to find out if fasting is required.</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-sm-6 p0\">\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse5\">Can I rebill my insurance provider for my lab tests? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse5\">\r\n<div class=\"panel-body\">We would be more than happy to send you an itemized receipt for you to submit to your insurance provider. There is no guarantee they will pay for your lab test.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse5i\">Do you take HSA/FSA cards for lab tests? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse5i\">\r\n<div class=\"panel-body\"><span style=\"line-height: 107%; font-family: Calibri, sans-serif; font-size: 12pt;\">Absolutely, we take Health Savings cards in addition to Visa, MasterCard, Discover, and American Express.&nbsp;</span></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse6\">Can you give any medical advice? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse6\">\r\n<div class=\"panel-body\">NCL does not provide any medical advice or promote any vitamin supplements, please discuss your lab test results with your doctor.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse7\">How do I contact customer service? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse7\">\r\n<div class=\"panel-body\">You can call 1-800-519-2997 and email customer service at customerservice@newcenturylabs.com</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n', '', '', '', '', NULL, '2017-03-04 08:38:30', 1, 0, NULL, 'faq'),
(15, 'page', 'terms', 'Terms', NULL, '', '<section class=\"inr-intro-area pt100 \">\r\n<div class=\"container\">\r\n<div class=\"page__title text-center mb30\">\r\n<h2>TERMS AND CONDITIONS</h2>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"cont-area  pt30 pb30 big \">\r\n<div class=\"container\">\r\n<p>NewCenturylabs.com and New Century Labs LLC is a registered company in the state of Oregon that provides direct lab services through our listed diagnostic partners: Quest Diagnostics, Spectracell, and DDC. When you purchase a lab test, you agree to be bound by the following terms &amp; conditions:</p>\r\n\r\n<p>Newcenturylabs.com reserves the right to make changes to the terms &amp; conditions at any time.</p>\r\n\r\n<ol>\r\n	<li>You agree that you are at least 18 years old.</li>\r\n	<li>No refunds are available after specimen is collected.</li>\r\n	<li>You agree that a lab test purchased through newcenturylabs.com does not constitute medical advice. The test results are not a diagnosis, treatment or protocol for any disease or condition and it is recommended that you discuss all results with a qualified health professional. You also agree that the lab test results can be inaccurate through no fault of Newcenturylabs.com or New Century Labs, LLC or any of our ordering physicians or diagnostic partners. You agree that it is your own responsibility to consult your own physician about your lab test results. You understand and agree that neither Newcenturylabs.com, New Century Labs, LLC nor the ordering physician or diagnostic partners is your medical provider and that no patient/physician relationship exists or will exist as a result of your lab test order or your lab results. You agree that your test results are provided for educational purposes only and you agree to follow-up with your own physician if you have any question about your lab results or do not feel well.</li>\r\n	<li>You agree to indemnify, defend and hold harmless Newcentury.com, New Century Labs, LLC and it&rsquo;s officers, directors, employees, agents, licensors, suppliers and any third party information providers to the Service, including the ordering physicians, from and against all losses, expenses, damages and costs, including reasonable attorneys&rsquo; fees, resulting from any violation of this Agreement by you.</li>\r\n	<li>You also agree not to use the website for illegal purposes.</li>\r\n	<li>You acknowledge and accept that New Century Labs, LLC and Newcenturylabs.com the ordering physicians and the laboratory may be compelled by state or local statue to report you abnormal laboratory result to the local health department and it is required for a physician to report most positive STD tests and abnormal lead levels to the local health department.</li>\r\n	<li>By placing an order with us, you agree to receive email marketing that provides promotions and health information. At any time you may opt out of these emails by emailing <a href=\"mailtto:customerservice@newcenturylabs.com\">customerservice@newcenturylabs.com</a></li>\r\n	<li>Your lab test results will be sent to your email by a HIPAA complaint encrypted email server prompting you to create a password to access your results.</li>\r\n	<li>Requisitions will be sent to your email address you provide after payment is made.</li>\r\n	<li>Your lab test results will be accessed only by physicians and staff members of newcenturylabs.com and Quest Diagnostics and or SpectraCell Laboratories or DDC. Newcenturylabs.com will only release health information to comply with legal requirements as set forth by the Health Insurance Portability and Accountability Act (HIPAA) and other applicable state and federal laws. State laws require laboratories and physicians to report certain infectious disease-related test results to their local health departments.</li>\r\n	<li>Your personal information will not be sold to third parties we will only collect your information to order labs and for statistical purposes only.</li>\r\n	<li>Orders from NY,NJ,RI,MD,HI will be refunded. Orders from the listed states are not eligible, per state law, to order Direct-to-consumer.</li>\r\n</ol>\r\n</div>\r\n</section>\r\n', '', '', '', '', NULL, '2017-05-08 22:39:58', 1, 0, NULL, 'terms'),
(16, 'page', 'privacy', 'Privacy', NULL, '', '<section class=\"inr-intro-area pt100 \">\r\n		<div class=\"container\">\r\n				<div class=\"page__title text-center mb30 text-uppercase\">\r\n					<h2>Privacy Policy</h2>\r\n				</div>\r\n				\r\n		</div>\r\n	</section>\r\n	\r\n	\r\n	\r\n	<section class=\"cont-area  pt30 pb30 big\">\r\n		<div class=\"container\">\r\n	\r\n	<p>Patient Notification Regarding State-Mandated Reportable Conditions Certain infectious diseases and conditions and the identity of those who test positive for them, are required, by federal and/or state law, to be reported to local or state health authorities by your health care providers, including New Century Labs Ordering physicians, University Services, its physicians, staff, and the laboratories that run the medical tests. The time frames\r\nand reporting requirements vary according to the disease or condition. These local and state health authorities are considered Public Health Authorities according to the federal Health Insurance Portability and Accountability Act of 1996 (HIPAA) which means that they are legally authorized to receive your Protected Health Information (PHI). However, both New Century Labs, LLC and these health authorities will not otherwise share or release any confidential information, unless mandated by law or authorized by you in writing.</p>\r\n\r\n	<p>You understand that if you test positive for any infectious disease or condition on the states list of reportable conditions, your\r\ntest result and your identifying information will be reported to the applicable local or state health authority. Reporting this\r\ninformation does not require your permission or consent.\r\nAdditionally, you understand that if you test positive for any infectious disease or condition, neither New Century Labs, LLC, nor\r\nits staff, University Services, its physicians, staff, or the laboratories that run the medical tests, will treat, prescribe medications,\r\nor refer you for medical treatment. It is your sole responsibility to seek and comply with necessary treatment and all required\r\nfollow-up with your physician or local public health department.\r\nI authorize my health care providers, including University Services, its physicians and its staff and the laboratories that run\r\nmedical tests for me to use and/or disclose certain protected health information about me to New Century Labs, LLC for the\r\npurposes state below.</p>\r\n\r\n	<p>This authorization applies to the following protected health information about me: the laboratory requisition submitted by New\r\nCentury Labs, LLC and the laboratory test values which are the result of the laboratory test(s) requested in the requisition.\r\nFor avoidance of doubt, I specifically authorize the transfer of this information between and among me and the following\r\nParticipants, organizations and their representatives: i) New Century Labs, LLC ii) University Services staff and physician of\r\nrecord, and iii) the reference laboratory of record.\r\nI understand that University Services physician of record may be required to receive my lab test results before I do, and that\r\nthis physicians authorization to release those results to New Century Labs, LLC may also be required before I receive my\r\nresults.</p>\r\n\r\n\r\n	<p>The protected health information will be used or disclosed for the sole purpose of complying with the state and federal laws\r\nwhich may require a physician or their agent to: 1) review and approve a laboratory requisition; and 2) review the laboratory\r\ntest results. This review may be conducted for any reason, including in the event laboratory values, which are outside of\r\nnormal ranges, require the physician or its agent to contact me.\r\nThe purposes outlined above are provided so that I can make an informed decision whether to allow release of the information\r\nto the parties referenced in this authorization. This authorization will expire one year after the date of this authorization.\r\nI understand that I have a right to receive a copy of this authorization. I understand that the sole purpose of the laboratory test\r\nis to generate the results of the tests that I and New Century Labs, LLC have requested, and the laboratory tests will not be\r\nrequisitioned unless I sign this authorization. I have the right to refuse to agree to this authorization. When my information is\r\nused or disclosed pursuant to this authorization, it may be subject to re-disclosure by the recipient and may no longer be\r\nprotected by the federal HIPAA Privacy Rule. I have the right to revoke this authorization in writing at any time, except that the\r\nrevocation will not apply to any information already disclosed by the parties referenced in this authorization have acted in\r\nreliance upon this authorization. My written revocation must be submitted to the NCL privacy officer.\r\nPatient Authorization for Use and Disclosure of Protected Health Information</p>\r\n	\r\n	\r\n		</div>\r\n	</section>', '', '', '', '', NULL, NULL, 1, 0, NULL, 'privacy'),
(17, 'email', 'forgot_status', 'Forgot Password ', 'Forgot Password ', NULL, '<p>If you&#39;ve forgotten your password no worries, simply copy and paste your temporary password to this link below then create your unique password under &quot;my account.&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please email or call customer service if you have any questions.</p>\r\n\r\n<p><strong><u>HIPAA Notice</u></strong></p>\r\n\r\n<p>The contents of this message, together with any attachments, are intended only for the use of the person(s) to which they are addressed and may contain confidential and/or privileged information. Further, any medical information herein is confidential and protected by law. It is unlawful for unauthorized persons to use, review, copy, disclose, or disseminate confidential medical information. If you are not the intended recipient, immediately advise the sender and delete this message and any attachments. Any distribution, or copying of this message, or any attachment, is prohibited.</p>\r\n', '', NULL, NULL, NULL, NULL, NULL, 1, 0, NULL, NULL),
(18, 'email', 'registration', 'Registration', 'Verify Email Address | New Century Labs', NULL, '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<p>Hi <span>%%NAME%%!</span></p>\r\n\r\n			<p>Please confirm your email address by clicking the following link.</p>\r\n\r\n			<p><a class=\"btn\" href=\"%%LINK%%\" style=\"border-radius: 4px;background-color: #39c;color: #fff;display: inline-block;padding: 5px 10px;text-decoration: none;\">Click here</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Respectfully yours,<br />\r\n			New Century Labs</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', NULL, NULL, NULL, NULL, '2017-02-21 13:32:13', 1, 0, NULL, NULL),
(19, 'page', 'verify_success', 'Email Verify Success', NULL, '', '<section class=\"inr-intro-area pt100 \">&nbsp;</section>\r\n\r\n<section class=\"cont-area  pt30 pb30 big \">\r\n<div class=\"container\">\r\n<p>You email has been successfully verified.</p>\r\n</div>\r\n</section>\r\n', '', '', '', '', NULL, '2017-02-21 13:31:02', 1, 0, NULL, NULL),
(20, 'page', 'verify_fail', 'Email verify Fail', NULL, '', '<section class=\"inr-intro-area pt100 \">&nbsp;</section>\r\n\r\n<section class=\"cont-area  pt30 pb30 big \">\r\n<div class=\"container\">\r\n<p>Email verification failure.</p>\r\n</div>\r\n</section>\r\n', '', '', '', '', NULL, NULL, 1, 0, NULL, NULL),
(21, 'page', 'home_bk', 'Home Bk', NULL, '', '<section class=\"slider-area no-ctrl fadeft\">\r\n<div class=\"carousel slide\" data-interval=\"false\" data-ride=\"carousel\" id=\"carousel-example-generic\">\r\n<ol class=\"carousel-indicators hidden\">\r\n	<li class=\"active\" data-slide-to=\"0\" data-target=\"#carousel-example-generic\">&nbsp;</li>\r\n	<li data-slide-to=\"1\" data-target=\"#carousel-example-generic\">&nbsp;</li>\r\n	<li data-slide-to=\"2\" data-target=\"#carousel-example-generic\">&nbsp;</li>\r\n</ol>\r\n<!-- Wrapper for slides -->\r\n\r\n<div class=\"carousel-inner\">\r\n<div class=\"item active\"><img alt=\"...\" src=\"{{asset(\'\')}}front/images/slide1.jpg\" />\r\n<div class=\"container posrel\">\r\n<div class=\"caro-caps anime-flipInX\">\r\n<h1>The most <strong>affordable</strong> blood tests online</h1>\r\n\r\n<p>We offer over 100 tests online from single tests to advanced compressive panels you can order from the comfort of your home.</p>\r\n\r\n<div class=\"lnk-btn inline-block more-btn\"><a href=\"register\">Sign Up With Us</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"box-area text-center pt20 pb50\">\r\n<div class=\"container\">\r\n<div class=\"hed\">\r\n<h2>IT&rsquo;S EASY TO GET STARTED</h2>\r\n\r\n<p>Place your order on your desk top or any mobile device<br />\r\nGet Your lab order and view your results sent to your email.</p>\r\n</div>\r\n\r\n<div class=\"box col-sm-4 anime-left \">\r\n<div class=\"box__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/icon1.png\" /></div>\r\n\r\n<div class=\"box__cont \">\r\n<h4>View labs &amp; order test</h4>\r\n\r\n<p>Your lab order will be emailed to you securely</p>\r\n\r\n<div class=\"lnk-btn more-btn\"><a href=\"#\">LEARN MORE</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"box col-sm-4 anime-in\">\r\n<div class=\"box__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/icon2.png\" /></div>\r\n\r\n<div class=\"box__cont\">\r\n<h4>Print your lab order</h4>\r\n\r\n<p>Your lab order can be easily printed from your home PC</p>\r\n\r\n<div class=\"lnk-btn more-btn\"><a href=\"#\">LEARN MORE</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"box col-sm-4 anime-right\">\r\n<div class=\"box__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/icon3.png\" /></div>\r\n\r\n<div class=\"box__cont\">\r\n<h4>Visit one of or our locations</h4>\r\n\r\n<p>Visit one of our 2,300 friendly affiliated draw sites with your lab order, no appointment needed</p>\r\n\r\n<div class=\"lnk-btn more-btn\"><a href=\"#\">LEARN MORE</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"most-area text-center bg-full pt50 pb50\">\r\n<div class=\"container\">\r\n<div class=\"most__cont col-sm-7 valigner anime-left\">\r\n<div class=\"valign\">\r\n<h3>THE MOST <span>AFFORDABLE</span> BLOOD TESTS</h3>\r\n\r\n<p>Wouldn&rsquo;t you like to know what&rsquo;s going on in your body without paying an arm and a leg? We make prices affordable and access easy the way it should be. You can now order lab tests on your terms, on demand 24 hour a day 7 days per week from your desktop or any mobile device</p>\r\n\r\n<div class=\"lnk-btn browse-btn\"><a href=\"shop\">View all Test &gt;&gt;</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"most__img col-sm-5\">\r\n<div class=\"most__inr box\">\r\n<div class=\"most__inr__img hidden\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/box1.jpg\" /></div>\r\n\r\n<div class=\"most__inr__cont text-center \">\r\n<h3>CMP</h3>\r\n\r\n<p>(Complete Metabolic Panel)</p>\r\n\r\n<h2><sup>$</sup>14.00</h2>\r\n<strong>Average competitors price</strong>\r\n\r\n<h4><sup>$</sup>45.00</h4>\r\n<strong>Pricing based on average direct to consumer pricing.</strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"most-area text-center pt50 pb50\">\r\n<div class=\"container\">\r\n<div class=\"most__cont col-sm-7 valigner anime-right pul-rgt\">\r\n<div class=\"valign\">\r\n<h3>Empower <span>yourself</span> get to know the real &ldquo;YOU&rdquo; Take <span>control</span> of your health!</h3>\r\n\r\n<p>Did you know that 70-80% of all clinical decisions come from lab tests and disease happens before you get a symptom. Don&#39;t neglect yourself, empower yourself and take charge.</p>\r\n\r\n<div class=\"lnk-btn browse-btn\"><a href=\"how-to-order\">Let&rsquo;s Get Proactive &gt;&gt;</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"most__img col-sm-5 pul-lft \">\r\n<div class=\"most__inr box\">\r\n<div class=\"most__inr__img\"><img alt=\"\" src=\"{{asset(\'\')}}front/images/box2.jpg\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"vdo-area text-center\">\r\n<div class=\"container0\">\r\n<div class=\"col-sm-12 p0\"><iframe frameborder=\"0\" height=\"420\" src=\"https://www.youtube.com/embed/TlNw-ybTo-w\" width=\"100%\"></iframe>\r\n\r\n<div class=\"vdo__cont hidden\">\r\n<h2>THIS IS WHAT KIM HAD TO SAY</h2>\r\n\r\n<p>&ldquo;New Century Labs is my hero&rdquo;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"testlab-area text-center bg-full white p100 valigner mt40 rotate-img--hover\" style=\"background-image: url(\'{{asset(\'\')}}front/images/testlab-bg.jpg\');\">\r\n<div class=\"container\">\r\n<div class=\"valign\">\r\n<h4>My Lab tests are so affordable and I&rsquo;m now able to have a more meaningful conversation with my doctor</h4>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"faq-area pb50\">\r\n<div class=\"container\">\r\n<div class=\"hed text-center\">\r\n<h2>FAQ</h2>\r\n</div>\r\n\r\n<div calss=\"cont\">\r\n<h3>Still have questions?</h3>\r\n\r\n<p>Here are some of the commonly asked questions people have about lab testing</p>\r\n\r\n<div class=\"panel-group accordion-arr\" id=\"accordion\">\r\n<div class=\"col-sm-6 p0\">\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapseOne\">Can I take my lab test results to my doctor? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse \" id=\"collapseOne\">\r\n<div class=\"panel-body\">Absolutely! We encourage you to take your lab test results to your doctor if you need to.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapseTwo\">When do I get my results? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapseTwo\">\r\n<div class=\"panel-body\">It depends on the test most tests take 24-72 hours to complete however some test may take longer, please click on the test you are interested in to find out more information.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapseThree\">Can I order a lab test not offered on your website? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapseThree\">\r\n<div class=\"panel-body\">Yes, all you have to do is email customer service with the test code and name of the test and we will make sure you get it.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse4\">Do I need to fast before I go to the draw center? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse4\">\r\n<div class=\"panel-body\">It depends on the test, some test do not require fasting, please read the description on under patient prep to find out if fasting is required.</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-sm-6 p0\">\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse5\">Can I rebill my insurance provider for my lab tests? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse5\">\r\n<div class=\"panel-body\">We would be more than happy to send you an itemized receipt for you to submit to your insurance provider. There is no guarantee they will pay for your lab test.</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse5i\">Do you take HSA/FSA cards for lab tests? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse5i\">\r\n<div class=\"panel-body\"><span style=\"line-height: 107%; font-family: Calibri, sans-serif; font-size: 12pt;\">Absolutely, we take Health Savings cards in addition to Visa MasterCard, Discover and American Express.</span></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse6\">Can you give any medical advice? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse6\">\r\n<div class=\"panel-body\">NCL does not provide any medical advice or promote any vitamin supplements, please discuss your lab test results with your doctor</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse7\">How do I contact customer service? </a></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse7\">\r\n<div class=\"panel-body\">You can call 1-800-519-2997 and email customer service at customerservice@newcenturylabs.com</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n', '', '', '', '', NULL, NULL, 1, 0, NULL, NULL);
