(1, 'Rainbow Pop', 'Toffee Flavoured Ice Confection with Caramel Syrup and topped with Chocolate Disc and Multicoloured Popping Candy.', '<p><span style=\"box-sizing: border-box; font-weight: 700; font-family: CenturyGothic; font-size: 14px;\">Chocolate Flavoured Ice Cream coated with chocolate flavoured coating and 3% peanuts</span><br style=\"box-sizing: border-box; font-family: CenturyGothic; font-size: 14px;\" />\r\n<span style=\"font-family: CenturyGothic; font-size: 14px;\">Ingredients: Chocolate flavoured coating (contains soya lecithin), sugar, whey protein concentrate (contains milk), coconut oil, palm oil, peanuts, glucose syrup, whey powder, maltodextrin, contains permitted emulsifier (E471-plant origin), stabilisers (E410, E412, E407), flavourings and colouring (Including Tartrazine) substances of plant and synthetic origin.</span><br style=\"box-sizing: border-box; font-family: CenturyGothic; font-size: 14px;\" />\r\n<span style=\"font-family: CenturyGothic; font-size: 14px;\">May contain traces of cereals containing gluten and soybean</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: CenturyGothic; font-size: 14px;\">&nbsp;</p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px 0px 0px 15px; list-style-position: initial; list-style-image: initial; padding-right: 0px; padding-left: 0px; font-family: CenturyGothic; font-size: 14px;\">\r\n	<li style=\"box-sizing: border-box;\">Keep Frozen Under -18&deg;C</li>\r\n	<li style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Minimum Net Content:</span>&nbsp;73ml (57g)</li>\r\n	<li style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Country of Origin:</span>&nbsp;Thailand</li>\r\n	<li style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Halal certified by:</span>&nbsp;The Central Islamic Committee of Thailand (Recognized by JAKIM)</li>\r\n</ul>\r\n', '9571526769028.png', 'Rainbow Pop', 1, 0, '2018-05-19 22:30:28', '2018-06-23 22:25:54', NULL, 120, 0, 0, 0, 1, 'simple', NULL, 1, 0, 'rainbow_pop'),
(2, 'Classic Vanilla', 'Toffee Flavoured Ice Confection with Caramel Syrup and topped with Chocolate Disc and Multicoloured Popping Candy.', '<p>French vanilla flavored ice confection topped with chocolate flavored topping and peanuts.</p>\r\n', '9541526769144.jpg', 'Rainbow Pop', 1, 0, '2018-05-19 22:32:24', '2018-06-24 00:31:00', NULL, 120, 0, 0, 0, 1, 'simple', NULL, 1, 1, 'classic_vanilla'),
(3, 'Classic Chocolate', 'Toffee Flavoured Ice Confection with Caramel Syrup and topped with Chocolate Disc and Multicoloured Popping Candy.', '<p>French vanilla flavored ice confection topped with chocolate flavored topping and peanuts.</p>\r\n', '5611526769198.jpg', 'Rainbow Pop', 1, 0, '2018-05-19 22:33:18', '2018-05-19 22:33:18', NULL, 150, NULL, 0, 0, 1, 'simple', NULL, NULL, 0, 'classic_chocola'),
(4, 'Walls\'s Family Treat', 'Walls\'s Family Treat ', '<p>Cream Deligt 2 litre<br />\r\n&nbsp;</p>\r\n', '6361527410298.jpg', 'icecreame', 1, 0, '2018-05-27 08:38:18', '2018-05-27 08:38:18', NULL, 530, NULL, 0, 0, 1, 'bundle', NULL, NULL, 0, 'wft'),
(5, 'Kids Mania', 'For kids', '<p>For kids party</p>\r\n', '5451527411289.jpg', 'icecream', 1, 0, '2018-05-27 08:54:49', '2018-05-27 08:54:49', NULL, 520, NULL, 0, 0, 1, 'bundle', NULL, NULL, 0, 'km'),
